    t[234] = "Note: Your contribution to the network (network share) is determined by the allocation of upstream bandwidth (upload speed).";
    t[235] = "Huomautus: Panoksesi verkkoon (verkkoosuus) m\u00e4\u00e4r\u00e4ytyy yl\u00e4virran kaistanleveyden (latausnopeuden) varauksen mukaan.";
    t[236] = "Advanced Router Configuration";
    t[237] = "Edistynyt Reitittimen Kokoonpano";
    t[238] = "Allocate number of processor threads for building tunnels. If your processor supports hyperthreading or simultaneous multithreading, you may multiply the number of processor cores by 2 to get the maximum number of threads to allocate, otherwise number of processor cores = maximum number of threads available. Note that you may wish to allocate less than the theoretical maximum to ensure you have headroom for other tasks.";
    t[239] = "Aseta suorittimen s\u00e4ikeiden m\u00e4\u00e4r\u00e4 tunnelien rakentamista varten. Jos suorittimesi tukee hyperthreadingi\u00e4 tai samanaikaista monis\u00e4ikeisyytt\u00e4, voit kaksinkertaistaa prosessoriytimien m\u00e4\u00e4r\u00e4n m\u00e4\u00e4ritt\u00e4\u00e4ksesi enimm\u00e4iss\u00e4ikeiden m\u00e4\u00e4r\u00e4n, muuten s\u00e4ikeiden m\u00e4\u00e4r\u00e4 vastaa k\u00e4ytett\u00e4viss\u00e4 olevien prosessoriytimien m\u00e4\u00e4r\u00e4\u00e4. Huomaa, ett\u00e4 saatat haluta m\u00e4\u00e4ritt\u00e4\u00e4 k\u00e4ytett\u00e4v\u00e4ksi teoreettista enimm\u00e4ism\u00e4\u00e4r\u00e4\u00e4 v\u00e4hemm\u00e4n varmistaaksesi, ett\u00e4 sinulla on liikkumavaraa muille teht\u00e4ville.";
