    t[364] = "When a new service tunnel is created, or a service is run for the first time (e.g. the default jetty webserver, plugins), a private encryption key is created which essentially controls the ownership of address. This is usually named <code>&hellip;privKey.dat</code>, or <code>eepPriv.dat</code>, though it's a good idea to change the name to indicate the service it belongs to and then respecify it in the Tunnel Manager server settings. This .dat file should be backed up safely; lose it and you will lose ownership and control of your hostname!";
    t[365] = "Kun luodaan uusi palvelutunneli tai palvelu ajetaan ensimm\u00e4isen kerran (esim. oletusarvoinen jetty-webpalvelin, liit\u00e4nn\u00e4iset), luodaan yksityinen salausavain, joka hallitsee k\u00e4yt\u00e4nn\u00f6ss\u00e4 osoitteen omistamista. T\u00e4m\u00e4 on yleens\u00e4 nimelt\u00e4\u00e4n <code>&hellip;privKey.dat</code> tai <code>eepPriv.dat</code>, vaikka onkin hyv\u00e4 idea vaihtaa nimi osoittamaan sille kuuluvaa palvelua, ja m\u00e4\u00e4ritt\u00e4\u00e4 se uudelleen Tunnelinjohtajan palvelinasetuksissa. T\u00e4m\u00e4 .dat-tiedosto tulisi varmuuskopioida turvallisesti; menet\u00e4 se ja menet\u00e4t omistajuuden ja hallinnan verkkotunnuksestasi!";
    t[368] = "This setting allows configuration of the maximum number of files per torrent I2PSnark will permit, when downloading or creating a torrent. Note that substantially increasing this value from the default of 2000 files may require additional configuration on the host system to increase the maximum number of open files the operating system will permit (e.g. <code>ulimit -n</code> on Linux). To change, add to I2PSnark's configuration file <code>i2psnark.config</code>. [Restart of I2PSnark or router required]";
    t[369] = "T\u00e4m\u00e4 asetus mahdollistaa I2PSnarkin m\u00e4\u00e4ritt\u00e4m\u00e4n enimm\u00e4ism\u00e4\u00e4r\u00e4n tiedostoja per torrent-lataus tai torrentin luonti. Huomaa, ett\u00e4 t\u00e4m\u00e4n arvon merkitt\u00e4v\u00e4 lis\u00e4\u00e4minen oletusarvosta 2000 tiedostoa voi vaatia lis\u00e4konfigurointia is\u00e4nt\u00e4j\u00e4rjestelm\u00e4ss\u00e4, jotta k\u00e4ytt\u00f6j\u00e4rjestelm\u00e4n sallima enimm\u00e4isavaamisten m\u00e4\u00e4r\u00e4 voidaan lis\u00e4t\u00e4 (esim. <code>ulimit -n</code> Linuxissa). Muuttaaksesi t\u00e4t\u00e4, lis\u00e4\u00e4 I2PSnarkin asetustiedostoon <code>i2psnark.config</code>. [Vaaditaan I2PSnarkin tai reitittimen uudelleenk\u00e4ynnistys]";
    t[370] = "Configure router bandwidth allocation";
    t[371] = "M\u00e4\u00e4rit\u00e4 reitittimen kaistanleveyden varaus";
    t[372] = "Here are some other public addressbook subscription links. You may wish to add one or two to your <a href='/dns?subscriptions' target=_blank rel=noreferrer>susidns subscription list</a>. In the event that addresses conflict in the subscriptions, the lists placed at the top of your susidns configuration will take precedence over those placed further down.";
    t[373] = "T\u00e4ss\u00e4 on muutama muu julkinen osoitekirjatilauksen linkki. Voit halutessasi lis\u00e4t\u00e4 yhden tai kaksi <a href='/dns?subscriptions' target=_blank rel=noreferrer>susidns-tilauksesi listaan</a>. Jos osoitteet aiheuttavat ristiriitoja tilauksissa, susidns-m\u00e4\u00e4rityksen yl\u00e4osassa olevat luettelot menev\u00e4t etusijalle verrattuna alempana oleviin.";
