    t[549] = "uudelleenkylv\u00f6 tiedostosta";
    t[554] = "Choose a name for your website (<i>hostname</i>.i2p), using lower-case. To verify that the hostname is available, check <a href=http://notbob.i2p/ target=_blank>notbob.i2p</a> or <a href=http://reg.i2p target=_blank>reg.i2p</a> before you decide. Enter the new name for your website on the <a href='/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a> where it says <i>Website name</i>, replacing the default <i>mysite.i2p</i> placeholder. If you want your website to be available when I2P starts, enable <i>Auto Start</i> and then click <i>Save</i>.";
    t[555] = "Valitse verkkosivustosi nimi (<i>is\u00e4nt\u00e4nimi</i>.i2p) k\u00e4ytt\u00e4en pieni\u00e4 kirjaimia. Varmista, ett\u00e4 is\u00e4nt\u00e4nimi on saatavilla tarkistamalla <a href=http://notbob.i2p/ target=_blank>notbob.i2p</a> tai <a href=http://reg.i2p target=_blank>reg.i2p</a> ennen p\u00e4\u00e4t\u00f6ksentekoa. Kirjoita uusi nimi verkkosivustollesi <a href='/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page -sivulle</a>, jossa lukee <i>Verkkosivun nimi</i>, korvaten oletusarvon  <i>mysite.i2p</i>. Jos haluat, ett\u00e4 verkkosivustosi on k\u00e4ytett\u00e4viss\u00e4 I2P:n k\u00e4ynnistyess\u00e4, ota k\u00e4ytt\u00f6\u00f6n <i>Automaattinen k\u00e4ynnistys</i> ja napsauta sitten <i>Tallenna</i>.";
    t[556] = "When set to true, this enables gzip compression for the router console and default web applications. [Enabled by default]";
