    t[616] = "Bonuses may be positive or negative, and affect the peer's inclusion in Fast and High Capacity tiers. Fast peers are used for client tunnels, and High Capacity peers are used for some exploratory tunnels.";
    t[617] = "Bonukset voivat olla positiivisia tai negatiivisia, ja ne voivat vaikuttaa kumppanin sis\u00e4llytt\u00e4miseen Fast- ja High Capacity -tasoihin. Asiakastunneleissa k\u00e4ytet\u00e4\u00e4n nopeita vertaisversioita, ja joissakin tutkimustunneleissa k\u00e4ytet\u00e4\u00e4n korkean kapasiteetin vertaisia.";
    t[618] = "Yes";
