    t[620] = "While I2P will work fine in this configuration, if you really have over 128KBps of bandwidth to share, it will be much more helpful to the network if you open your firewall.";
    t[621] = "I2P toimii n\u00e4ill\u00e4 asetuksilla, mutta jos sinulla todella on 128 kbps kaistaa jaettavaksi, verkolle on siit\u00e4 enemm\u00e4n hy\u00f6ty\u00e4, jos avaat palomuurisi.";
    t[622] = "A command-line application supplied with I2P that is used to request URL resources, similar to <a href=https://www.gnu.org/software/wget/ class='sitelink external' target=_blank rel=noreferrer>wget</a> or <a href=https://curl.haxx.se/ class='sitelink external' target=_blank rel=noreferrer>curl</a>. Eepget is also used internally by the router, for example to reseed from remote hosts. By default, eepget uses the HTTP proxy on <code>127.0.0.1:4444</code>.";
    t[623] = "I2P:n mukana tuleva komentorivisovellus, jota k\u00e4ytet\u00e4\u00e4n URL-resurssien pyyt\u00e4miseen, samanlainen kuin <a href=https://www.gnu.org/software/wget/ class='sitelink external' target=_blank rel=noreferrer>wget</a> tai <a href=https://curl.haxx.se/ class='sitelink external' target=_blank rel=noreferrer>curl</a>. Eepgeti\u00e4 k\u00e4ytet\u00e4\u00e4n my\u00f6s sis\u00e4isesti reitittimess\u00e4, esimerkiksi uudelleennseminaatiota varten et\u00e4isist\u00e4 is\u00e4nnist\u00e4. Oletuksena eepget k\u00e4ytt\u00e4\u00e4 HTTP-v\u00e4lityspalvelinta osoitteessa <code>127.0.0.1:4444</code>.";
