    t[723] = "Javadocs";
    t[724] = "An eepsite is a website that is hosted anonymously on the I2P network - you can access it by configuring your web browser to use I2P's HTTP proxy (see above) and browsing to the <code>.i2p</code> suffixed website (e.g. <a href=http://i2p-projekt.i2p/ target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p</a>). Also ensure your browser is configured to resolve DNS remotely when using the proxy to avoid DNS leaks.";
    t[725] = "Eepsinetti on verkkosivusto, joka on anonyymisti is\u00e4nn\u00f6ity I2P-verkossa - p\u00e4\u00e4set siihen m\u00e4\u00e4ritt\u00e4m\u00e4ll\u00e4 verkkoselaimesi k\u00e4ytt\u00e4m\u00e4\u00e4n I2P:n HTTP-v\u00e4lityspalvelinta (katso yll\u00e4) ja selaamalla <code>.i2p</code> suffiksista verkkosivustoa (esim. <a href=http://i2p-projekt.i2p/ target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p</a>). Varmista my\u00f6s, ett\u00e4 verkkoselaimesi on m\u00e4\u00e4ritetty ratkaisemaan DNS-et\u00e4isesti k\u00e4ytett\u00e4ess\u00e4 v\u00e4lityspalvelinta, jotta v\u00e4ltet\u00e4\u00e4n DNS-vuodot.";
