    t[836] = "The first number is the number of peers your router has sent or received a message from in the last few minutes. This may range from 8-10 to several hundred, depending on your total bandwidth, shared bandwidth, and locally-generated traffic. The second number is the number of peers seen in the last hour or so. Do not be concerned if these numbers vary widely. <a href='/configstats#router.activePeers'>[Enable graphing]</a>.";
    t[837] = "Ensimm\u00e4inen numero on vertaisk\u00e4ytt\u00e4ji\u00e4, joiden kanssa reitittimesi on l\u00e4hett\u00e4nyt tai vastaanottanut viestej\u00e4 viimeisten muutaman minuutin aikana. T\u00e4m\u00e4 voi vaihdella 8-10:st\u00e4 useisiin satoihin riippuen kokonaiskaistanleveydest\u00e4si, jaettavasta kaistanleveydest\u00e4si sek\u00e4 paikallisesti generoidusta liikenteest\u00e4si. Toinen numero on vertaisk\u00e4ytt\u00e4jien m\u00e4\u00e4r\u00e4, jotka on havaittu viimeisen tunnin aikana. \u00c4l\u00e4 huolehdi, vaikka n\u00e4m\u00e4 numerot vaihtelevat paljon. <a href='/configstats#router.activePeers'>[Ota grafiikka k\u00e4ytt\u00f6\u00f6n]</a>.";
