    t[977] = "Ulkoisesti tavoitettavissa oleva is\u00e4nt\u00e4nimi tai IP-osoite";
    t[980] = "Your webserver is running by default at <a href=http://127.0.0.1:7658/>http://127.0.0.1:7658</a>, but is not accessible by others until you start the <i>I2P Webserver</i> tunnel. After starting the tunnel, your site will be difficult for other people to find. You could just tell people the destination or the Base32 address, but thankfully I2P has an address book to store domain names, and various services where you can <a href=/help/hostnameregistration>register a new .i2p domain</a> for free.";
    t[981] = "Verkkopalvelimeni toimii oletusarvoisesti osoitteessa <a href=http://127.0.0.1:7658/>http://127.0.0.1:7658</a>, mutta muut eiv\u00e4t p\u00e4\u00e4se siihen k\u00e4siksi, ennen kuin k\u00e4ynnist\u00e4t <i>I2P Webserver</i> -tunnelin. Kun olet k\u00e4ynnist\u00e4nyt tunnelin, sivustosi on vaikea l\u00f6yt\u00e4\u00e4 muille. Voit kertoa ihmisille vain kohteen tai Base32-osoitteen, mutta onneksi I2P:lle on olemassa osoitekirja, jossa voit tallentaa verkkotunnuksia, ja erilaisia palveluita, joissa voit <a href=/help/hostnameregistration>rekister\u00f6id\u00e4 uuden ilmaisen .i2p-verkkotunnuksen</a>.";
