    t[1174] = "Unless an outproxy has been set up for the service you want to connect to, this is not possible, with the exception of BitTorrent (see below). There are only three types of outproxies running right now: HTTP, HTTPS, and email. Note that there is currently no publicly listed SOCKS outproxy. If this type of service is required, try <a href=https://torproject.org/ target=_blank rel=noreferrer class='sitelink external'>Tor</a>.";
    t[1175] = "Ellei palvelua varten ole asetettu ulkoista v\u00e4lityspalvelinta, t\u00e4m\u00e4 ei ole mahdollista lukuun ottamatta BitTorrentia (katso alla oleva kohta). T\u00e4ll\u00e4 hetkell\u00e4 k\u00e4yt\u00f6ss\u00e4 on vain kolme tyyppi\u00e4 ulkoisia v\u00e4lityspalvelimia: HTTP, HTTPS ja s\u00e4hk\u00f6posti. Huomaa, ett\u00e4 t\u00e4ll\u00e4 hetkell\u00e4 ei ole julkisesti listattuja SOCKS-v\u00e4lityspalvelimia. Jos t\u00e4m\u00e4n tyyppinen palvelu on tarpeen, kokeile <a href=https://torproject.org/ target=_blank rel=noreferrer class='sitelink external'>Tor</a>.";
