    t[1209] = "Katson Big Techi\u00e4...";
    t[1212] = "The skew (offset) of your computer's clock relative to the network-synced time (if known). I2P requires your computer's time be accurate. If the skew is more than a few seconds, please correct the problem by adjusting your computer's time. If I2P cannot connect to the internet, a reading of 0ms may be indicated. Note: This is only displayed in the <i>Router Information (advanced)</i> section. You may add this section to your Sidebar on the <a href='/configsidebar'>Sidebar Configuration page</a>.";
    t[1213] = "Tietokoneesi kellon heitto (ero) suhteessa verkko-synkronoituun aikaan (jos tiedossa). I2P vaatii, ett\u00e4 tietokoneesi aika on tarkka. Jos heitto on enemm\u00e4n kuin muutama sekunti, korjaa ongelma s\u00e4\u00e4t\u00e4m\u00e4ll\u00e4 tietokoneen aikaa. Jos I2P ei pysty yhdistym\u00e4\u00e4n internettiin, lukema voi olla 0 ms. Huomaa: T\u00e4m\u00e4 n\u00e4kyy vain <i>Reititintiedot (edistynyt)</i> -osiossa. Voit lis\u00e4t\u00e4 t\u00e4m\u00e4n osion Sivupalkkiisi <a href='/configsidebar'>Sivupalkin asetukset -sivulta</a>.";
