    t[1272] = "To migrate the key to a new router, or to setup multihoming (running the same service on multiple routers for redundancy and load-balancing), copy the backed up key to your .i2p directory and specify it in the new server tunnel, or replace the default key in the plugin folder (e.g. the zzzot plugin).";
    t[1273] = "Siirt\u00e4\u00e4ksesi avaimen uuteen reitittimeen tai asentaaksesi monipes\u00e4kkeen (ajamalla samaa palvelua useammalla reitittimell\u00e4 redundanssia ja kuorman tasapainottamista varten), kopioi varmuuskopioitu avain .i2p-hakemistoosi ja m\u00e4\u00e4rit\u00e4 se uudessa palvelutunnelissa tai korvaa oletusavain liit\u00e4nn\u00e4iskansiossa (esim. zzzot-liit\u00e4nn\u00e4inen).";
