    t[1462] = "How long an outbound message waits in the queue. This should generally be a few hundred milliseconds or less. If it is consistently higher than 1000ms, your computer is very slow, or you should adjust your bandwidth limits, or your (BitTorrent?) clients may be sending too much data and should have their transmit bandwidth limit reduced. <a href='/configstats#transport.sendProcessingTime'>[Enable graphing]</a> (transport.sendProcessingTime).";
    t[1463] = "Kuinka kauan ulosp\u00e4in suuntautuva viesti odottaa jonossa. T\u00e4m\u00e4n pit\u00e4isi yleens\u00e4 olla muutama sata millisekuntia tai v\u00e4hemm\u00e4n. Jos se on jatkuvasti yli 1000 ms, tietokoneesi on hyvin hidas tai sinun tulisi s\u00e4\u00e4t\u00e4\u00e4 kaistanleveysrajat tai (BitTorrent?) asiakkaasi saattavat l\u00e4hett\u00e4\u00e4 liikaa dataa ja niiden l\u00e4hetyskaistanleveysrajoitusta tulisi v\u00e4hent\u00e4\u00e4. <a href='/configstats#transport.sendProcessingTime'>[Ota k\u00e4ytt\u00f6\u00f6n kaavion piirt\u00e4minen]</a> (transport.sendProcessingTime).";
