    t[2250] = "How long jobs are waiting before execution. The job queue is listed on the <a href='/jobs'>Jobs page</a>. Unfortunately, there are several other job queues in the router that may be congested, and their status is not available in the router console. The job lag should generally be zero. If it is consistently higher than 500ms, your computer is very slow, your network is experiencing connectivity issues, or the router has serious problems. <a href='/configstats#jobQueue.jobLag'>[Enable graphing]</a>.";
    t[2251] = "Kuinka kauan ty\u00f6t odottavat ennen suoritusta. Ty\u00f6jonot on lueteltu <a href='/jobs'>Ty\u00f6t-sivulla</a>. Valitettavasti reitittimess\u00e4 on useita muita ty\u00f6jonoja, jotka saattavat olla ruuhkautuneita, eik\u00e4 niiden tilaa ole saatavilla reitittimen ohjauskeskuksesta. Ty\u00f6n viiveen tulisi yleens\u00e4 olla nolla. Jos se on jatkuvasti yli 500 ms, tietokoneesi on eritt\u00e4in hidas, verkossasi on yhteysh\u00e4iri\u00f6it\u00e4 tai reitittimess\u00e4 on vakavia ongelmia. <a href='/configstats#jobQueue.jobLag'>[Ota k\u00e4ytt\u00f6\u00f6n graafit]</a>.";
    t[2252] = "Configure I2P Updates";
    t[2253] = "M\u00e4\u00e4rit\u00e4 I2P-p\u00e4ivitykset";
    t[2254] = "Before you tell the world about your new website, you should add some content. Go to the server's root directory <a href=#rootdir>listed above</a> and replace the <i>index.html</i> redirect page with your own content. If you need a template for a basic site, feel free to adapt <a href=http://127.0.0.1:7658/help/pagetemplate.html>this page</a>. If you're returned to this page after editing the content, try clearing your browser's web cache.";
    t[2255] = "Ennen kuin kerrot maailmalle uudesta verkkosivustostasi, sinun pit\u00e4isi lis\u00e4t\u00e4 sis\u00e4lt\u00f6\u00e4. Mene palvelimen juurihakemistoon <a href=#rootdir>yll\u00e4 listattu</a> ja korvaa <i>index.html</i> uudelleenohjaussivu omalla sis\u00e4ll\u00f6ll\u00e4si. Jos tarvitset perussivustolle mallipohjaa, voit vapaasti sopeuttaa <a href=http://127.0.0.1:7658/help/pagetemplate.html>t\u00e4t\u00e4 sivua</a>. Jos palaat t\u00e4lle sivulle sis\u00e4ll\u00f6n muokkauksen j\u00e4lkeen, yrit\u00e4 tyhjent\u00e4\u00e4 selaimen v\u00e4limuisti.";
