    t[2295] = "Oletuskynnys koskee kaikkia et\u00e4kohdepalvelimia, joita ei ole m\u00e4\u00e4ritelty selv\u00e4sti m\u00e4\u00e4ritelm\u00e4ss\u00e4 tai mink\u00e4\u00e4n viitattavan tiedoston osalta. Oletuskynnyksen asettamiseksi k\u00e4yt\u00e4 avainsanaa <i class=example>default</i>.";
