    t[2312] = "If your router has 10 or more active peers, everything is fine. The router should maintain connections to a few peers at all times. The best way to stay \"better-connected\" to the network is to <a href=/config>share more bandwidth</a>.";
    t[2313] = "Jos reitittimess\u00e4si on 10 tai useampi aktiivinen vertainen, kaikki on kunnossa. Reitittimen pit\u00e4isi pit\u00e4\u00e4 yll\u00e4 yhteyksi\u00e4 muutamaan vertaiseen koko ajan. Paras tapa pysy\u00e4 paremmin yhteydess\u00e4 verkkoon on <a href=/config>jakaa enemm\u00e4n kaistanleveytt\u00e4</a>.";
