    t[2371] = "Sanasto";
    t[2376] = "To obtain your own hostname, I2P domain registrars such as <a href=http://stats.i2p/i2p/addkey.html target=_blank rel=noreferrer class=sitelink>stats.i2p</a> or <a href=http://reg.i2p/ target=_blank rel=noreferrer class=sitelink>reg.i2p</a> provide registration services that allow you to register and manage an .i2p hostname or sub-domain which will then be propagated across the network. Some registration sites will require the <i>B64 destination address</i> for the tunnel/service you wish to associate with a hostname, which you should copy from the <i>Local destination</i> section on the <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>.";
    t[2377] = "Oman verkkosivun osoitteen saamiseksi voit rekister\u00f6id\u00e4 I2P-verkkotunnuksen palveluntarjoajien, kuten <a href=http://stats.i2p/i2p/addkey.html target=_blank rel=noreferrer class=sitelink>stats.i2p</a> tai <a href=http://reg.i2p/ target=_blank rel=noreferrer class=sitelink>reg.i2p</a> kautta. N\u00e4iden tarjoajien avulla voit rekister\u00f6id\u00e4 ja hallinnoida .i2p-verkkosivun osoitetta tai aliverkkotunnusta, jonka tiedot levitet\u00e4\u00e4n sitten verkon kautta. Joidenkin rekister\u00f6intisivustojen osalta sinulta voi edellytt\u00e4\u00e4 <i>B64-kohdeosoitetta</i> tunnelin/palvelun kanssa, johon haluat yhdist\u00e4\u00e4 verkkosivun osoitteen. T\u00e4m\u00e4n voit kopioida <i>Paikallinen kohde</i> -osasta <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration</a> -sivulta.";
