    t[2471] = "Manuaaliset vertaisohjaukset";
    t[2482] = "This indicates the amount of RAM I2P is using, and the total amount available, allocated by Java. If the usage is consistently high relative to the available RAM, this may indicate that you need to increase the ram allocated to the JVM. You can allocate more RAM by editing your <code>wrapper.config</code> file which is normally located in the I2P application directory. You will need to edit the <code>wrapper.java.maxmemory</code> parameter, which by default is set to 256(MB) for I2P, or 384 for I2P+. Note: if the memory bar is enabled, the memory entry in the router info section will be suppressed.";
    t[2483] = "Kertoo kuinka paljon RAM-muistia I2P k\u00e4ytt\u00e4\u00e4 sek\u00e4 k\u00e4ytett\u00e4viss\u00e4 olevan kokonaismuistin m\u00e4\u00e4r\u00e4n, joka on jaettu Javan toimesta. Jos k\u00e4ytt\u00f6 on jatkuvasti korkea suhteessa k\u00e4ytett\u00e4viss\u00e4 olevaan RAM-muistiin, t\u00e4m\u00e4 voi kertoa, ett\u00e4 sinun on lis\u00e4tt\u00e4v\u00e4 RAM-muistia JVM:lle. Voit jakaa enemm\u00e4n RAM-muistia muokkaamalla <code>wrapper.config</code> -tiedostoa, joka sijaitsee tavallisesti I2P-sovelluksen hakemistossa. Sinun on muokattava <code>wrapper.java.maxmemory</code> -parametri\u00e4, jonka oletusarvo on 256(MB) I2P:lle tai 384 I2P+:lle. Huomio: jos muistipalkki on k\u00e4yt\u00f6ss\u00e4, muistiotteen reititintiedon osiosta tukitaan.";
