    t[2536] = "Under <i>Configure Proxy Access to Internet</i> select the <i>Manual proxy configuration</i> option.";
    t[2537] = "Valitse <i>M\u00e4\u00e4rit\u00e4 v\u00e4lityspalvelimen k\u00e4ytt\u00f6 Internetiin</i> -kohdassa vaihtoehto <i>Manuaalinen v\u00e4lityspalvelimen m\u00e4\u00e4ritys</i>.";
    t[2538] = "To serve your own static content, you only need to edit or replace the files in the webserver's root directory, and the site will be available on the I2P network after you've followed the instructions below. Additionally, cgi and python scripts can be run from the <code>cgi-bin</code> directory immediately above <code>docroot</code> if you have <a href=https://www.perl.org/about.html target=_blank rel=noreferrer class='sitelink external'>perl</a> and <a href=https://www.python.org/ target=_blank rel=noreferrer class='sitelink external'>python</a> installed.";
    t[2539] = "Voit toimittaa oman staattisen sis\u00e4ll\u00f6n korvaamalla tiedostot verkkopalvelimen juurihakemistossa, niin sivusto on saatavilla I2P-verkossa seurattuasi ohjeita alla. Lis\u00e4ksi, cgi ja python skriptit voidaan suorittaat <code>docroot</code>:n v\u00e4litt\u00f6m\u00e4ss\u00e4 yl\u00e4puolella sijaitsevasta <code>cgi-bin</code> hakemistosta, mik\u00e4li sinulla on <a href=https://www.perl.org/about.html target=_blank rel=noreferrer class='sitelink external'>perl</a> ja <a href=https://www.python.org/ target=_blank rel=noreferrer class='sitelink external'>python</a> asennettuna.";
