    t[2578] = "Many of the stats on the sidebar may be <a href='/configstats'>configured</a> to be <a href='/graphs'>graphed</a> for further analysis. You may also customize the sections that appear on the Sidebar and their positioning on the <a href='/configsidebar'>Sidebar Configuration page</a>.";
    t[2579] = "Monia sivupalkin tilastoja voidaan <a href='/configstats'>m\u00e4\u00e4ritt\u00e4\u00e4</a> <a href='/graphs'>graafisiksi</a> lis\u00e4tarkastelua varten. Voit my\u00f6s mukauttaa sivupalkilla n\u00e4kyvi\u00e4 osioita ja niiden sijaintia <a href='/configsidebar'>Sivupalkin konfigurointisivulla.</a>";
    t[2582] = "This tunnel-specific setting allows you to enable or disable replies to pings sent to servers hosted by the router. To disable pings, you must add the line <code>i2p.streaming.answerPings=false</code> to the <i>Custom Options</i> section for the server's configuration in the Tunnel Manager.";
    t[2583] = "T\u00e4m\u00e4 tunnelikohtainen asetus mahdollistaa sinun ottaa k\u00e4ytt\u00f6\u00f6n tai poistaa k\u00e4yt\u00f6st\u00e4 vastaukset reitittimen is\u00e4nn\u00f6imille palvelimille l\u00e4hetettyihin pingviesteihin. Pingejen poistamiseksi sinun on lis\u00e4tt\u00e4v\u00e4 rivi <code>i2p.streaming.answerPings=false</code> palvelimen kokoonpanon <i>Mukautetut valinnat</i> -osioon Tunnel Managerissa.";
    t[2592] = "Max";
    t[2593] = "Enint\u00e4\u00e4n";
    t[2598] = "If you wish to install unsigned (.zip) I2P updates, this should be added to your <code>router.config</code> file unless you have already configured <code>routerconsole.advanced=true</code>, in which case this option is already provisioned. Note: as of I2P+ 0.9.48+, installation of <a href=/configupdate#i2pupdates>unsigned updates</a> is enabled by default.";
    t[2599] = "Jos haluat asentaa allekirjoittamattomia (.zip) I2P-p\u00e4ivityksi\u00e4, t\u00e4m\u00e4 tulisi lis\u00e4t\u00e4 <code>router.config</code>-tiedostoon, ellei <code>routerconsole.advanced=true</code> ole jo m\u00e4\u00e4ritetty, jolloin t\u00e4m\u00e4 vaihtoehto on jo varustettu. Huomaa: I2P+ -version 0.9.48+ asennus <a href=/configupdate#i2pupdates>allekirjoittamattomista p\u00e4ivityksist\u00e4</a> on oletusarvoisesti k\u00e4yt\u00f6ss\u00e4.";
