    t[2616] = "If you know and trust somebody that runs I2P, ask them to send you a reseed file generated using this page in their router console. Then, select the <i>Reseed from file</i> option on the {0} using the file you received.";
    t[2617] = "Jos tunnet jonkun, joka k\u00e4ytt\u00e4\u00e4 I2P:a ja luotat h\u00e4neen, pyyd\u00e4 heit\u00e4 l\u00e4hett\u00e4m\u00e4\u00e4n sinulle uudelleenkylv\u00f6tiedosto, joka on luotu t\u00e4t\u00e4 sivua k\u00e4ytt\u00e4m\u00e4ll\u00e4 heid\u00e4n reitittimen konsolissaan. Valitse sitten <i>Kylv\u00e4 uudelleen tiedostosta</i> -vaihtoehto {0}:ssa k\u00e4ytt\u00e4en vastaanottamaasi tiedostoa.";
    t[2620] = "To enable session-only changes to the client tunnels, activate the console's <a href=\"/help/advancedsettings\">Advanced mode</a>.";
