    t[2696] = "This setting (in seconds) allows you to override the delay between runs of the Peer Exploration Job which attempts to locate new peers to add to the NetDb. The job will run every 80 seconds by default, or if the router is experiencing job or message lag, every 3 minutes. If the size of the NetDb reaches 4000 peers, the pause will increase to 15 minutes. You may wish to increase the delay if your NetDb is well-populated (over 2000 peers), or if you wish to reduce overall bandwidth usage. Note: For Floodfill routers, this job does not run.";
    t[2697] = "T\u00e4m\u00e4 asetus (sekunneissa) mahdollistaa verkkop\u00e4\u00e4tutkimusten v\u00e4listen viiveiden ohittamisen, joita verkkop\u00e4\u00e4tutkimusteht\u00e4v\u00e4 kirjaa l\u00f6yt\u00e4\u00e4kseen uusia vertaisia NetDb:hen lis\u00e4t\u00e4kseen. Oletusarvoisesti teht\u00e4v\u00e4 suoritetaan joka 80. sekunti, tai jos reititin kokee ty\u00f6n tai viestien viivett\u00e4, joka 3. minuutti. Jos NetDb:n koko kasvaa 4000 vertaiseen, viive kaksinkertaistuu 15. minuuttiin. Voit halutessasi lis\u00e4t\u00e4 viivett\u00e4, jos NetDb:ss\u00e4 on runsaasti vertaisia (yli 2000), tai jos haluat v\u00e4hent\u00e4\u00e4 kokonaiskaistanleveyden k\u00e4ytt\u00f6\u00e4. Huomaa: Tulvaumpireitittimille t\u00e4m\u00e4 teht\u00e4v\u00e4 ei suoritu.";
    t[2698] = "Current";
    t[2699] = "Nykyinen";
    t[2720] = "A website hosted on the I2P network. By default, a <a href=https://www.eclipse.org/jetty/about.html class='sitelink external' target=_blank rel=noreferrer>Jetty webserver</a> is configured and running on <a href=http://127.0.0.1:7658/ target=_blank rel=noreferrer>http://127.0.0.1:7658/</a>.";
    t[2721] = "Verkkoon I2P is\u00e4nn\u00f6ity verkkosivusto. Oletuksena <a href=https://www.eclipse.org/jetty/about.html class='sitelink external' target=_blank rel=noreferrer>Jetty-palvelinohjelmisto</a> on m\u00e4\u00e4ritetty ja k\u00e4ynniss\u00e4 osoitteessa <a href=http://127.0.0.1:7658/ target=_blank rel=noreferrer>http://127.0.0.1:7658/</a>.";
    t[2722] = "Can be disabled or changed in the <a href=/i2ptunnelmgr>Tunnel Manager</a>. Can also be configured to bind to a specific interface or all interfaces.";
    t[2723] = "Voit poistaa k\u00e4yt\u00f6st\u00e4 tai muuttaa sit\u00e4 <a href=/i2ptunnelmgr>Tunnel Manager</a> -sovelluksessa. Voit my\u00f6s m\u00e4\u00e4ritt\u00e4\u00e4 sen sitoutumaan tiettyyn rajapintaan tai kaikkiin rajapintoihin.";
    t[2728] = "I2P+ Service now enabled on system start";
    t[2729] = "I2P-palvelu on nyt k\u00e4yt\u00f6ss\u00e4 j\u00e4rjestelm\u00e4n k\u00e4ynnistyksen yhteydess\u00e4";
    t[2748] = "Computer related news aggregation";
    t[2749] = "Tietokoneeseen liittyv\u00e4 uutiskooste";
    t[2752] = "Same IP as us";
    t[2753] = "Sama IP kuin meill\u00e4";
    t[2754] = "You may create a new router family here. Once you have created the family, you may export the family key file and share with other routers in your nominated family.";
    t[2755] = "Voit luoda uuden reititinperheen t\u00e4\u00e4ll\u00e4. ";
    t[2756] = "Tunnels peer has agreed to participate in";
    t[2757] = "Tunnelien vertaiskumppani on suostunut osallistumaan";
    t[2758] = "Advanced Lookup";
    t[2759] = "Tarkennettu haku";
    t[2766] = "In order to access websites hosted on I2P, and optionally use the default outproxy to connect to websites on clearnet, you will need to configure your browser to use the I2P HTTP proxy, by default running on <code>127.0.0.1 port 4444</code>. Most browsers offer an option to configure your proxy; in this mini-tutorial we'll focus on Firefox.";
    t[2767] = "Jotta voit k\u00e4ytt\u00e4\u00e4 I2P:ll\u00e4 olevia verkkosivustoja ja halutessasi k\u00e4ytt\u00e4\u00e4 oletusarvoista v\u00e4lityspalvelinta yhdist\u00e4\u00e4ksesi selaimen verkkosivustoihin tavallisessa internetiss\u00e4, sinun tulee m\u00e4\u00e4ritt\u00e4\u00e4 selaimen asetukset k\u00e4ytt\u00e4m\u00e4\u00e4n I2P:n HTTP-v\u00e4lityspalvelinta, joka oletuksena py\u00f6rii osoitteessa <code>127.0.0.1 portti 4444</code>. Useimmissa selaimissa on mahdollista m\u00e4\u00e4ritt\u00e4\u00e4 v\u00e4lityspalvelin; t\u00e4ss\u00e4 miniohjeessa keskitymme Firefox-selaimeen.";
    t[2776] = "Close to us";
    t[2777] = "L\u00e4hell\u00e4 meit\u00e4";
    t[2790] = "I2P+ Router Sitemap";
    t[2791] = "I2P-reitittimen sivustokartta";
    t[2794] = "Downloaded plugin version {0} is not newer than installed plugin";
    t[2795] = "Ladatun laajennuksen versio {0} ei ole uudempi kuin asennettu laajennus";
    t[2796] = "Streaming radio service";
    t[2797] = "Suoratoistoradiopalvelu";
    t[2798] = "I2P+ functions best when you can accurately reflect the speed of your network connection in the <a href=/config>bandwidth configuration section</a>. By default I2P+ is configured with some fairly conservative values that will not suit many use cases, so please take time to review these settings and correct where necessary. The more bandwidth you allocate, <i>specifically</i> upstream bandwidth, the more you will benefit from the network.";
    t[2799] = "I2P+ toimii parhaiten, kun voit heijastaa tarkasti verkkoyhteytesi nopeuden <a href=/config>kaistanleveyden kokoonpano-osassa</a>. Oletusarvoisesti I2P+ on konfiguroitu melko konservatiivisilla arvoilla, jotka eiv\u00e4t sovellu monille k\u00e4ytt\u00f6tapauksille, joten k\u00e4yt\u00e4 aikaa n\u00e4iden asetusten tarkistamiseen ja korjaamiseen tarvittaessa. Mit\u00e4 enemm\u00e4n kaistanleveytt\u00e4 osoitat, <i>erityisesti</i> yl\u00e4virtakaista, sit\u00e4 enemm\u00e4n hy\u00f6dyt verkosta.";
    t[2810] = "Transit by Peer";
