    t[2844] = "What to do in the event I2P+ isn't working";
    t[2845] = "Mit\u00e4 tehd\u00e4, jos I2P+ ei toimi";
    t[2856] = "ANONYMITY WARNING - Settings include 1-hop tunnels.";
    t[2857] = "ANONYMITEETTIVAROITUS - Asetukset sis\u00e4lt\u00e4v\u00e4t yhden hypyn k\u00e4yt\u00e4vi\u00e4.";
    t[2858] = "I2P IRC Network";
    t[2859] = "I2P IRC-verkko";
    t[2864] = "pixels wide";
    t[2865] = "pikseli\u00e4 leve\u00e4";
    t[2882] = "The I2P Network Protocol (I2NP) manages the routing and mixing of messages between routers, in addition to the transport selection (where more than one is supported) when communicating with a peer. For more information, see the <a href=https://geti2p.net/en/docs/protocol/i2np class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[2883] = "I2P-verkkoprotokolla (I2NP) hallinnoi viestien reitityst\u00e4 ja sekoittamista reitittimien v\u00e4lill\u00e4 sek\u00e4 kuljetusvalinnan (jossa useampi kuin yksi on tuettu) viestint\u00e4\u00e4n vertaisen kanssa. Lis\u00e4tietoja saa <a href=https://geti2p.net/en/docs/protocol/i2np class='sitelink external' target=_blank rel=noreferrer>verkkodokumentaatiosta</a>.";
    t[2884] = "Expired {0} ago";
    t[2885] = "Vanhentunut {0} sitten";
    t[2892] = "Your router's status on accepting or rejecting requests from other routers to build a participating tunnel through your router. Your router may accept all requests, accept or reject a percentage of requests, or reject all requests for a number of reasons, to control the bandwidth and CPU demands and maintain capacity for local clients. <b>Note";
    t[2893] = "Reitittimesi tila siit\u00e4, hyv\u00e4ksyyk\u00f6 vai hylk\u00e4\u00e4k\u00f6 se muiden reitittimien pyynn\u00f6t osallistua tunnelin rakentamiseen reitittimesi kautta. Reitittimesi voi hyv\u00e4ksy\u00e4 kaikki pyynn\u00f6t, hyv\u00e4ksy\u00e4 tai hyl\u00e4t\u00e4 prosentuaalisesti osan pyynn\u00f6ist\u00e4 tai hyl\u00e4t\u00e4 kaikki pyynn\u00f6t useista syist\u00e4, jotta se voi hallita kaistanleveyden ja CPU-vaatimusten m\u00e4\u00e4r\u00e4\u00e4 ja yll\u00e4pit\u00e4\u00e4 kapasiteettia paikallisille asiakkaille. <b>Huomaa";
    t[2902] = "Please contact a known trustworthy friend who has a running I2P router, and ask them for help with reseeding your I2P router. Request that they send you a reseed file exported from their running I2P router. It is vital that the file is exchanged over a secure channel, e.g. encrypted to avoid external tampering (PGP Sign, Encrypt and Verified with a trusted public key). The file itself is unsigned, so please accept files only from known trusted friends. Never import a reseed file if you cannot verify its source.";
    t[2903] = "Ole hyv\u00e4 ja ota yhteytt\u00e4 tunnettuun luotettavaan yst\u00e4v\u00e4\u00e4n, jolla on k\u00e4ynniss\u00e4 I2P-reititin, ja pyyd\u00e4 heit\u00e4 auttamaan I2P-reitittimen uudelleenvaravoimisessa. Pyyd\u00e4 heit\u00e4 l\u00e4hett\u00e4m\u00e4\u00e4n sinulle uudelleenvarann\u00f6l\u00f6stiedosto, joka on viety heid\u00e4n k\u00e4ynniss\u00e4 olevasta I2P-reitittimest\u00e4\u00e4n. On eritt\u00e4in t\u00e4rke\u00e4\u00e4, ett\u00e4 tiedosto vaihdetaan turvallisessa kanavassa, kuten salattuna v\u00e4ltt\u00e4\u00e4kseen ulkoiset muutokset (allekirjoittakaa tiedosto PGP:ll\u00e4, salatkaa ja varmistakaa se luotetulla julkisella avaimella). Itse tiedosto on allekirjoittamaton, joten hyv\u00e4ksy tiedostoja ainoastaan tunnetuilta luotetuilta yst\u00e4vilt\u00e4. \u00c4l\u00e4 tuo uudelleenvarann\u00f6l\u00f6stiedostoa, jos et voi varmistaa sen l\u00e4hdett\u00e4.";
    t[2916] = "Last Good Send";
    t[2917] = "Viimeinen hyv\u00e4 l\u00e4hetys";
    t[2918] = "Delete this value to disable";
    t[2919] = "Poista t\u00e4m\u00e4 arvo k\u00e4yt\u00f6st\u00e4 poistamiseksi";
    t[2920] = "You can use a recorder in one tunnel that writes to a file that another tunnel, or multiple tunnels, can use for throttling. These files can also be edited by hand.";
    t[2921] = "Voit k\u00e4ytt\u00e4\u00e4 tallenninta yhdess\u00e4 tunnelissa, joka kirjoittaa tiedostoon, jota toinen tunneli tai useat tunnelit voivat k\u00e4ytt\u00e4\u00e4 kuristamiseen. N\u00e4it\u00e4 tiedostoja voidaan my\u00f6s muokata k\u00e4sin.";
    t[2924] = "Router running a non-native, software emulated version of the Java BigInteger library";
