    t[3093] = "T\u00e4m\u00e4 voidaan tehd\u00e4 k\u00e4ym\u00e4ll\u00e4 l\u00e4pi asiaan liittyv\u00e4n asiakaspalvelun m\u00e4\u00e4rityssivun <i>Jaettu asiakas</i> alla oleva <i>Jaa tunnelit muiden m\u00e4\u00e4ritettyjen asiakkaiden kanssa</i> -asetus ja poistaa sen valinta. T\u00e4m\u00e4n j\u00e4lkeen sinun on k\u00e4ynnistett\u00e4v\u00e4 asiakaspalvelu uudelleen <a href=/i2ptunnelmgr>Tunnel Managerin etusivulta</a>.";
