    t[3188] = "When set to true, additional functionality will be enabled in the console and the user will be able to edit settings directly on the <a href=/configadvanced>Advanced Configuration page</a>. Extra display options are provided in the <a href=/netdb>Network Database section</a>, including the <a href='/netdb?f=3'>Sybil Analysis tool</a>, and there are additional configuration options on the <a href=/configclients>Clients Configuration page</a>. This will also enable the installation of unsigned updates, manual configuration of the news URL, and additional sections on the sidebar.";
    t[3189] = "Kun t\u00e4m\u00e4 on asetettu arvoon \"true\", lis\u00e4toiminnallisuus otetaan k\u00e4ytt\u00f6\u00f6n konsolissa ja k\u00e4ytt\u00e4j\u00e4 voi muokata asetuksia suoraan <a href=/configadvanced>kehittyneiden asetusten sivulla</a>. Lis\u00e4n\u00e4ytt\u00f6vaihtoehdot ovat saatavilla <a href=/netdb>verkkotietokannan osassa</a>, mukaan lukien <a href='/netdb?f=3'>Sybil-analyysity\u00f6kalu</a>, ja lis\u00e4ksi on muita m\u00e4\u00e4ritysvaihtoehtoja <a href=/configclients>Aseman m\u00e4\u00e4ritys -sivulla</a>. T\u00e4m\u00e4 mahdollistaa my\u00f6s vahvistamattomien p\u00e4ivitysten asentamisen, uutis-URL: n manuaalisen m\u00e4\u00e4rityksen ja lis\u00e4osiot sivupalkissa.";
