    t[3486] = "This is the number of peers your router has available for building client tunnels. It is generally in the range 8-30. Your fast peers are shown on the <a href='/profiles'>Profiles page</a>. <a href='/configstats#router.fastPeers'>[Enable graphing]</a>";
    t[3487] = "T\u00e4m\u00e4 on reitittimesi k\u00e4ytett\u00e4viss\u00e4 olevien vertaisverkkojen m\u00e4\u00e4r\u00e4 asiakastunnelien luomiseen. Yleens\u00e4 se on 8-30. Nopeat vertaisverkkosi n\u00e4kyv\u00e4t <a href='/profiles'>Profiilit-sivulla</a>. <a href='/configstats#router.fastPeers'>[Ota graafiset tiedot k\u00e4ytt\u00f6\u00f6n]</a>";
    t[3488] = "Click the <i>Reseed from File</i> button";
    t[3489] = "Klikkaa <i>Uudelleenvaravi\u00e4 tyhj\u00e4st\u00e4 tiedostosta</i> -painiketta";
    t[3490] = "A variant of onion routing that encrypts multiple messages together to make it more difficult for attackers to perform traffic analysis and to increase the speed of data transfer. For more information, see the <a href=https://geti2p.net/en/docs/how/garlic-routing class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[3491] = "Sipulireitityksen variantti, joka salaa useita viestej\u00e4 yht\u00e4aikaa vaikeuttaakseen liikenteen analysointia ja parantaakseen tiedonsiirron nopeutta. Lis\u00e4tietoja l\u00f6yd\u00e4t <a href=https://geti2p.net/en/docs/how/garlic-routing class='sitelink external' target=_blank rel=noreferrer>verkkodokumentaatiosta</a>.";
    t[3494] = "How to Harden Your WordPress Site";
