    t[3618] = "ERR - Clock Skew";
    t[3619] = "VIRHE - Aikav\u00e4\u00e4ristym\u00e4";
    t[3624] = "This setting determines whether or not the router should use the provided <i>blocklist.txt</i> file and any user configured blocklists to enable banning of routers by hash or ip address. Ranges and net masks are supported for IPv4 but not IPv6. See the <i>blocklist.txt</i> in your I2P+ application directory for more info. [Enabled by default, restart required]";
    t[3625] = "T\u00e4m\u00e4 asetus m\u00e4\u00e4ritt\u00e4\u00e4, tulisiko reitittimen k\u00e4ytt\u00e4\u00e4 annettua <i>blocklist.txt</i> -tiedostoa ja k\u00e4ytt\u00e4j\u00e4n m\u00e4\u00e4ritt\u00e4mi\u00e4 estolistoja reitittimen est\u00e4miseksi hajosiin tai ip-osoitteilla. Ipv4:lle tuetaan alueita ja verkkoasettimia, mutta Ipv6 ei. Lis\u00e4tietoja on <i>blocklist.txt</i> -tiedostossa I2P+ sovelluskansiossa. [Oletusarvoisesti p\u00e4\u00e4ll\u00e4, uudelleenk\u00e4ynnistys vaaditaan]";
    t[3626] = "Licensing and copyright notices";
