    t[3635] = "Virallinen I2P-l\u00e4hdetietovarasto";
    t[3638] = "Outbound UDP on port 123, allowing replies: this is necessary for I2P's internal time sync (via SNTP - querying a random SNTP host in <code>pool.ntp.org</code> or <a href=/help/advancedsettings#ntpserverconfig>another server you specify</a>).";
    t[3639] = "L\u00e4htev\u00e4 UDP-porttiin 123, sallien vastaukset: t\u00e4m\u00e4 on v\u00e4ltt\u00e4m\u00e4t\u00f6nt\u00e4 I2P:n sis\u00e4iselle aikasykronoinnille (k\u00e4ytt\u00e4en SNTP:t\u00e4 - kysely suoritetaan satunnaiselle SNTP is\u00e4nn\u00e4lle <code>pool.ntp.org</code> tai <a href=/help/advancedsettings#ntpserverconfig>toiselle k\u00e4ytt\u00e4j\u00e4n m\u00e4\u00e4rittelem\u00e4lle palvelimelle</a>).";
    t[3646] = "NetDb Search";
    t[3647] = "NetDb-haku";
    t[3654] = "XChat-like client users can create a new network with the server <code>127.0.0.1/6668</code> (remember to tick <i>Bypass proxy server</i> if you have a proxy server configured), or you can connect with the command <code>/server 127.0.0.1 6668</code>. Different IRC clients may vary the syntax.";
    t[3655] = "XChat-tyyliset asiakasohjelmat voivat luoda uuden verkon palvelimen <code>127.0.0.1/6668</code> kanssa (muista ruksata <i>Bypass proxy server</i> jos sinulla on v\u00e4lityspalvelin m\u00e4\u00e4ritetty), tai voit yhdist\u00e4\u00e4 komennolla <code>/server 127.0.0.1 6668</code>. Eri IRC-asiakasohjelmissa syntaksi voi vaihdella.";
