    t[3704] = "The router configuration options listed below are not available in the user interface, usually because they are rarely used or provide access to advanced settings that most users will not need. This is not a comprehensive list. Some settings will require a restart of the router to take effect. Note that all settings are case sensitive. You will need to edit your <code>router.config</code> file to add options, or, once you have added <code>routerconsole.advanced=true</code> to the router.config file, you may edit settings within the console on the <a href=/configadvanced>Advanced Configuration page</a>.";
    t[3705] = "Alla luetellut reitittimen kokoonpanon valinnat eiv\u00e4t ole k\u00e4ytett\u00e4viss\u00e4 k\u00e4ytt\u00f6liittym\u00e4ss\u00e4, yleens\u00e4 koska niit\u00e4 harvoin k\u00e4ytet\u00e4\u00e4n tai niill\u00e4 p\u00e4\u00e4see k\u00e4siksi edistyneisiin asetuksiin, joita useimmat k\u00e4ytt\u00e4j\u00e4t eiv\u00e4t tarvitse. T\u00e4m\u00e4 ei ole t\u00e4ydellinen luettelo. Jotkin asetukset vaativat reitittimen uudelleenk\u00e4ynnistyksen tullaakseen voimaan. Huomioi, ett\u00e4 kaikki asetukset ovat kirjainkohtaisia. Sinun tulee muokata <code>router.config</code>-tiedostoa lis\u00e4t\u00e4ksesi valintoja tai kun olet lis\u00e4nnyt <code>routerconsole.advanced=true</code> router.config-tiedostoon, voit muokata asetuksia konsolissa <a href=/configadvanced>Edistyneen konfigurointisivun</a> kautta.";
