    t[3780] = "To preserve anonymity, make sure that the webserver is not publicly available outside of the I2P network, which is normally achieved by configuring the webserver to listen on localhost (127.0.0.1) rather than all interfaces (0.0.0.0).";
    t[3781] = "S\u00e4ilytt\u00e4\u00e4ksesi anonymiteetin, varmista, ett\u00e4 web-palvelin ei ole julkisesti saatavilla I2P-verkon ulkopuolella, mik\u00e4 yleens\u00e4 saavutetaan m\u00e4\u00e4ritt\u00e4m\u00e4ll\u00e4 web-palvelin kuuntelemaan localhostia (127.0.0.1) eik\u00e4 kaikkia liit\u00e4nt\u00f6j\u00e4 (0.0.0.0).";
