    t[3958] = "I2P requires your computer's time be accurate.";
    t[3959] = "I2P edellytt\u00e4\u00e4, ett\u00e4 tietokoneesi aika on tarkka.";
    t[3960] = "Just finished jobs";
    t[3961] = "Juuri p\u00e4\u00e4ttyneet ty\u00f6t";
    t[3962] = "Some IRC clients are configured to disconnect from the server if there's been no communication with the server for a period of time, which can sometimes be problematic for I2P IRC if the <i>ping timeout</i> value is set too low. Setting the ping timeout value in your client to a high value (e.g. 320 seconds) will often result in a more robust connection to the network. In hexchat you can configure the value by typing <code>/set net_ping_timeout 320</code>. This will write the value to your <code>hexchat.conf</code> file.";
    t[3963] = "Jotkin IRC-asiakasohjelmat on m\u00e4\u00e4ritetty katkaisemaan yhteys palvelimeen, mik\u00e4li ei ole tapahtunut viestint\u00e4\u00e4 palvelimen kanssa tietyn ajan jakson aikana. T\u00e4m\u00e4 voi aiheuttaa ongelmia I2P IRC:n kanssa, jos <i>ping timeout</i> -arvo on liian pieni. Aseta asiakasohjelman ping timeout -arvo suureksi (esim. 320 sekuntia), mik\u00e4 usein johtaa vakaampaan yhteyteen verkkoon. Hexchatissa voit tehd\u00e4 t\u00e4m\u00e4n asettamalla arvon komennolla <code>/set net_ping_timeout 320</code>. T\u00e4m\u00e4 kirjoittaa arvon tiedostoon <code>hexchat.conf</code>.";
    t[3964] = "Run at Startup?";
    t[3965] = "Suorita k\u00e4ynnistett\u00e4ess\u00e4?";
    t[3972] = "Never";
    t[3973] = "Ei koskaan";
    t[3978] = "An <a href=/confignet#ipchange>optional configuration</a> that automatically changes your <a href=/netdb?r=.>router identity</a> and <a href=/confignet#udpconfig>external port</a> when the public ip address your system is on changes. This can prevent an adversary from correlating your router identity and ip address in scenarios where your ip address may change frequently, for example when you're running I2P on a laptop from multiple locations.";
    t[3979] = "Vaihtoehtoinen m\u00e4\u00e4rittely, joka muuttaa automaattisesti <a href=/netdb?r=.>reitittimen tunnistetta</a> ja <a href=/confignet#udpconfig>ulkopuolista porttia</a>, kun julkisen IP-osoitteen muuttuu. T\u00e4m\u00e4 voi est\u00e4\u00e4 vastapuolta yhdist\u00e4m\u00e4st\u00e4 reitittimen tunnistetta ja IP-osoitetta skenaarioissa, joissa IP-osoite voi muuttua usein, esimerkiksi kun ajat I2P:i\u00e4 kannettavalta tietokoneelta useammasta paikasta.";
    t[3982] = "The router is not configured to publish its address, therefore it does not expect incoming connections.";
    t[3983] = "Reititint\u00e4 ei ole asetettu julkaisemaan osoitettaan, eik\u00e4 se siis odota sis\u00e4\u00e4ntulevia yhteyksi\u00e4.";
    t[3998] = "A command-line application supplied with I2P+ (Linux/MacOS) that is used to perform a <code>head</code> request on a specified http resource on the network, returning various response headers from the remote server. By default, eephead uses the HTTP proxy on <code>127.0.0.1:4444</code>.";
    t[3999] = "I2P+:lla (Linux/MacOS) toimitettu komentorivisovellus, jota k\u00e4ytet\u00e4\u00e4n suorittamaan <code>head</code>-pyynt\u00f6 m\u00e4\u00e4ritetylle HTTP-resursille verkossa, palauttaen erilaisia vastausotsikoita et\u00e4palvelimelta. Oletuksena eephead k\u00e4ytt\u00e4\u00e4 HTTP-proxy\u00e4 osoitteella <code>127.0.0.1:4444</code>.";
    t[4010] = "NTCP [IPv6] &amp; SSU with Introducers";
    t[4011] = "IPv6 NTCP, SSU, esittelij\u00e4t";
