    t[4026] = "This setting permits a custom text prefix to be set for the page title on router console pages, potentially useful when you have multiple consoles open on browser tabs and want an easy method to differentiate between them.";
    t[4027] = "T\u00e4m\u00e4 asetus sallii mukautetun tekstin etuliitteen asettamisen reititin valikon sivun otsikkoon, mik\u00e4 voi olla hy\u00f6dyllist\u00e4, kun useita konsolleja on auki selaimen v\u00e4lilehdill\u00e4 ja haluat helpon menetelm\u00e4n niiden erotteluun.";
