    t[4053] = "Ty\u00f6tilastot (pois lukien yksitt\u00e4iset ty\u00f6t)";
    t[4054] = "In order to access websites hosted on the I2P network, and optionally use the default outproxy to connect to websites on clearnet, you will need to configure your browser to use the I2P+ <b>HTTP</b> proxy, by default running on <code>127.0.0.1 port 4444</code>. For more help, see <a href=https://geti2p.net/htproxyports target=_blank rel=noreferrer>the configuration guide</a>, or <a href=/help/configuration#browserconfig>the mini-tutorial for Firefox</a>.";
    t[4055] = "Jotta voit k\u00e4ytt\u00e4\u00e4 I2P-verkossa sijaitsevia verkkosivustoja ja valinnaisesti k\u00e4ytt\u00e4\u00e4 oletusarvoista ulkoproksia yhdist\u00e4\u00e4ksesi verkkosivustoihin selkeiss\u00e4 verkko-olosuhteissa, sinun on m\u00e4\u00e4ritett\u00e4v\u00e4 selain k\u00e4ytt\u00e4m\u00e4\u00e4n I2P+ <b>HTTP</b> v\u00e4lityspalvelinta, joka oletuksena toimii osoitteessa <code>127.0.0.1 portti 4444</code>. Lis\u00e4ohjeita saat katsomalla <a href=https://geti2p.net/htproxyports target=_blank rel=noreferrer>konfigurointioppaan</a> tai <a href=/help/configuration#browserconfig>mini-oppaan Firefox-selainta varten</a>.";
