    t[4332] = "Note: The order of the declarations matters. The first threshold declaration for a given destination (whether explicit or listed in a referenced file) overrides any future thresholds for the same destination, whether explicit or listed in a file. Note: to apply a new filter file, the tunnel must be restarted after the location has been specified in the tunnel manager. Once configured, a definition file can be updated without requiring a restart of the target tunnel, although destinations that are blocked will persist until the tunnel is restarted.";
    t[4333] = "Huomaa: Deklaraatioiden j\u00e4rjestyksell\u00e4 on merkityst\u00e4. Ensimm\u00e4inen kynnysarvon julistus tietylle kohteelle (oli se sitten selke\u00e4sti ilmoitettu tai luettelossa viitetiedostossa) korvaa tulevat kynnysarvot samalle kohteelle, oli ne sitten selv\u00e4sti ilmoitettu tai luettelossa tiedostossa. Huomaa: uuden suodatus-tiedoston k\u00e4ytt\u00e4miseksi tunneli on k\u00e4ynnistett\u00e4v\u00e4 uudelleen sen j\u00e4lkeen kun sijainti on m\u00e4\u00e4ritelty tunnelin hallintaan. Kun m\u00e4\u00e4ritetty, m\u00e4\u00e4ritelm\u00e4tiedostoa voidaan p\u00e4ivitt\u00e4\u00e4 ilman, ett\u00e4 kohdetunnelia tarvitsee k\u00e4ynnist\u00e4\u00e4 uudelleen, vaikka estetyt kohteet s\u00e4ilyv\u00e4t, kunnes tunneli k\u00e4ynnistet\u00e4\u00e4n uudelleen.";
