    t[4697] = "Suosi IPv4:\u00e4\u00e4 IPv6:n sijaan";
    t[4702] = "NTCP (NIO-based TCP) and NTCP2 are TCP-based network transports which use Java's NIO (New I/O) TCP implementation to deliver I2NP messages between routers on the network. NTCP2 improves the resistance of NTCP to various attacks and automated traffic identification methods. For more information, see the <a href=https://geti2p.net/en/docs/transport/ntcp class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[4703] = "NTCP (NIO-pohjainen TCP) ja NTCP2 ovat TCP-pohjaisia verkkosiirtoja, jotka k\u00e4ytt\u00e4v\u00e4t Javan NIO (New I/O) TCP -toteutusta I2NP-viestien toimittamiseen verkossa olevien reitittimien v\u00e4lill\u00e4. NTCP2 parantaa NTCP:n kest\u00e4vyytt\u00e4 erilaisiin hy\u00f6kk\u00e4yksiin ja automaattisiin liikenteen tunnistusmenetelmiin. Lis\u00e4tietoja l\u00f6ytyy <a href=https://geti2p.net/en/docs/transport/ntcp class='sitelink external' target=_blank rel=noreferrer>verkkodokumentaatiosta</a>.";
    t[4708] = "You can use a recorder to log the destinations of aggressive clients to a specified file, and then use that same file to throttle them. The following snippet defines a filter that initially allows all connection requests, but if any single destination exceeds 180 requests in 60 seconds, it gets throttled down to 30 requests every 60 seconds:";
    t[4709] = "Voit k\u00e4ytt\u00e4\u00e4 nauhoituspit\u00e4j\u00e4\u00e4 kirjaamaan aggressiivisten asiakkaiden kohteita erilliselle tiedostolle, ja k\u00e4ytt\u00e4\u00e4 sitten samaa tiedostoa niiden rajoittamiseen. Seuraava katkelma m\u00e4\u00e4rittelee suotimen, joka aluksi sallii kaikki yhteyspyynn\u00f6t, mutta jos yksik\u00e4\u00e4n kohde ylitt\u00e4\u00e4 180 pyynt\u00f6\u00e4 60 sekunnissa, se rajoitetaan 30 pyynt\u00f6\u00f6n joka 60 sekunnissa:";
