    t[4931] = "T\u00e4m\u00e4 asetus mahdollistaa ylim\u00e4\u00e4r\u00e4isen k\u00e4ytt\u00e4j\u00e4n itse m\u00e4\u00e4rittelem\u00e4n estolistan lataamisen reitittimen k\u00e4ynnistyksen yhteydess\u00e4, kun se on m\u00e4\u00e4ritetty osoittamaan kelvolliseen estolistatiedostoon. [Oletusarvoisesti pois p\u00e4\u00e4lt\u00e4, uudelleenk\u00e4ynnistys vaaditaan]";
    t[4932] = "I2P+ supports custom theme overrides for the console, the tunnel manager, I2PSnark, SusiDNS and Susimail, permitting changes to the themes which are persistent after upgrades. In order to activate an override, create a css file named <code>override.css</code> with your theme modifications and place it in the relevant theme directory of the theme you wish to change, or rename one of the example files, and then hard refresh the browser. Note that the tunnel manager and the console share the same override.css. To deactivate an override, delete or rename the <code>override.css</code> file and then hard refresh the browser (usually Control + Shift + R).";
    t[4933] = "I2P+ tukee mukautettuja teemaylikirjoituksia hallintapaneeliin, tunnelin hallintaan, I2PSnarkiin, SusiDNS:\u00e4\u00e4n ja Susimailiin, mahdollistaen teemojen muutokset, jotka s\u00e4ilyv\u00e4t p\u00e4ivitysten j\u00e4lkeen. Jotta ylikirjoitus aktivoidaan, luo css-tiedosto nimelt\u00e4 <code>override.css</code> kansiossa jossa haluat vaihtaa teemaa olevaan teemakansioon ja tee teemamuokkauksesi siihen, tai nime\u00e4 jokin esimerkkitiedosto uudelleen ja sitten kovap\u00e4ivit\u00e4 selain. Huomaa, ett\u00e4 tunnelin hallinta ja hallintapaneeli jakavat saman override.css-tiedoston. Ylikirjoituksen deaktivoimiseksi poista tai nime\u00e4 uudelleen <code>override.css</code> tiedosto ja kovap\u00e4ivit\u00e4 selain (yleens\u00e4 Ctrl + Shift + R).";
