    t[5330] = "The default subscription is to <code>http://i2p-projekt.i2p/hosts.txt</code> which is seldom updated. If you don't have another subscription, you may often have to use \"jump\" links which is much slower but ensures that your addressbook is only populated by sites you use (in addition to the default subscription addresses). To speed up browsing on I2P, it's a good idea to add some addressbook subscriptions.";
    t[5331] = "Oletustilaus on osoitteessa <code>http://i2p-projekt.i2p/hosts.txt</code>, jota harvoin p\u00e4ivitet\u00e4\u00e4n. Jos sinulla ei ole muuta tilausta, joudut usein k\u00e4ytt\u00e4m\u00e4\u00e4n \"hyppy\"-linkkej\u00e4, jotka ovat paljon hitaampia, mutta varmistavat, ett\u00e4 osoitekirjaasi tulevat vain sivustot, joita k\u00e4yt\u00e4t (lis\u00e4ksi oletustilauksen osoitteita). I2P:n selaamisen nopeuttamiseksi on hyv\u00e4 idea lis\u00e4t\u00e4 joitain osoitekirjatilauksia.";
