    t[5514] = "If after a few minutes of uptime your router is indicating 0 Active Peers and 0 Known Peers, with a notification in the sidebar that you need to check your network connection, verify that you can access the internet. If your internet connection is functional, you may need to unblock Java in your firewall. Otherwise, you may need to reseed your I2P router. Visit the <a href=/configreseed#reseedconfig>Reseed Configuration page</a> and click the <i>Save Changes and Reseed Now</i> button. For more information, see the <a href=#reseedhelp>Reseed help section</a> above.";
    t[5515] = "Jos reitittimen k\u00e4ynnistyksen j\u00e4lkeen muutaman minuutin kuluttua reititin n\u00e4ytt\u00e4\u00e4 0 aktiivista vertaista ja 0 tunnettua vertaista ja sivupalkissa on ilmoitus, ett\u00e4 sinun t\u00e4ytyy tarkistaa verkkoyhteytesi, varmista, ett\u00e4 p\u00e4\u00e4set internettiin. Jos internetyhteytesi toimii, sinun saattaa tarvita avata Javan palomuuriestett\u00e4. Muussa tapauksessa sinun saattaa tarvita uudelleensijoittaa I2P-reitimesi. Mene <a href=/configreseed#reseedconfig>-otsikon alle ja napsauta sitten <i>Tallenna muutokset ja uudelleensijoita nyt</i>-painiketta. Lis\u00e4tietoja l\u00f6yd\u00e4t <a href=#reseedhelp>-otsikon alta.";
    t[5518] = "A higher level socket API for clients. Only opened when a SAM V3 client requests a UDP session. Can be enabled/disabled on the <a href=/configclients> Client Configuration page</a>. Can be changed in the <code>clients.config</code> file with the SAM command line option <code>sam.udp.port=nnnn</code>.";
    t[5519] = "Korkeamman tason socket API asiakkaille. Avataan vain, kun SAM V3 -asiakas pyyt\u00e4\u00e4 UDP-istuntoa. Sit\u00e4 voidaan ottaa k\u00e4ytt\u00f6\u00f6n/poistaa k\u00e4yt\u00f6st\u00e4 <a href=/configclients>Asiakasasetus-sivulla</a>. Sit\u00e4 voidaan muuttaa <code>clients.config</code> tiedostossa k\u00e4ytt\u00e4en SAM-komennon p\u00e4\u00e4ttelylinjaoptiota <code>sam.udp.port=nnnn</code>.";
    t[5526] = "If you want your site to feel responsive, image compression is essential when hosting large images. Using a service like <a href=https://tinypng.com/ target=_blank class='sitelink external'>tinypng.com</a> to compress your png and jpeg images will often result in much smaller files with minimal loss of quality. In some situations the webp format can best jpegs, generating smaller files with approximately the same or better visual fidelity, and has wide browser support. Also consider using svgs instead of bitmaps for icons and illustrations - they're often smaller than the equivalent bitmap file (run them through a service like <a href=https://vecta.io/nano target=_blank class='sitelink external'>Nano SVG Optimizer</a> to remove unneeded cruft), scale without loss of quality, and can be gzipped by your webserver.";
    t[5527] = "Jos haluat sivustosi tuntuvan reagoivalta, kuvien pakkaaminen on v\u00e4ltt\u00e4m\u00e4t\u00f6nt\u00e4, kun is\u00e4nn\u00f6it suuria kuvia. K\u00e4ytt\u00e4m\u00e4ll\u00e4 palvelua kuten <a href=https://tinypng.com/ target=_blank class='sitelink external'>tinypng.com</a> png- ja jpeg-kuvien pakkaamiseen, saat usein paljon pienempi\u00e4 tiedostoja v\u00e4h\u00e4isell\u00e4 laadun menetyksell\u00e4. Joissakin tilanteissa webp-muoto voi olla parempi kuin jpegit, tuottaen pienempi\u00e4 tiedostoja, joissa on suunnilleen sama tai parempi visuaalinen tarkkuus, ja tukee laajasti eri selaimia. Harkitse my\u00f6s svg-kuvien k\u00e4ytt\u00f6\u00e4 ikoneissa ja kuvituksissa - ne ovat usein pienempi\u00e4 kuin vastaava bittikartta (ajaa ne palvelun kautta, kuten <a href=https://vecta.io/nano target=_blank class='sitelink external'>Nano SVG Optimizer</a> poistaaksesi tarpeettoman roskan), skaalautuvat laadun menett\u00e4m\u00e4tt\u00e4, ja voivat olla gzip-pakattuja palvelimellasi.";
    t[5528] = "UPnP disabled on the device";
    t[5529] = "UPnP ei ole k\u00e4yt\u00f6ss\u00e4 laitteessa";
    t[5536] = "By default, most of your client services (mail, http proxy, IRC) will share the same set of tunnels (for performance reasons) and be listed as <i>Shared Clients</i> and <i>Shared Clients(DSA)</i> in the sidebar under Service Tunnels and on the <a href=/tunnels>Tunnels page</a>.";
    t[5537] = "Oletuksena suurin osa asiakaspalveluista (s\u00e4hk\u00f6posti, HTTP-v\u00e4lityspalvelin, IRC) jakaa saman tunnelisarjan (suorituskyvyn parantamiseksi) ja n\u00e4kyy <i>Jaetut asiakkaat</i> ja <i>Jaetut asiakkaat (DSA)</i> sivupalkissa Palvelutunnelit-osion alla ja <a href=/tunnels>tunnelisivulla</a>.";
