    t[5545] = "T\u00e4t\u00e4 osiota ei ole oletuksena k\u00e4yt\u00f6ss\u00e4, elless\u00e4si <a href='/help/configuration#advancedconsole'>Advanced Console -tilaa</a> ole viel\u00e4 otettu k\u00e4ytt\u00f6\u00f6n. Voit ottaa sen k\u00e4ytt\u00f6\u00f6n <a href='/configsidebar'>Sidebar Configuration -sivulla</a>.";
