    t[5684] = "Check to see if another program is using the configured port. If so, stop that program or configure I2P to use a different port.";
    t[5685] = "Tarkasta, k\u00e4ytt\u00e4\u00e4k\u00f6 joku muu ohjelma m\u00e4\u00e4ritelty\u00e4 porttia. Jos, niin pys\u00e4yt\u00e4 tuo ohjelma tai aseta I2P k\u00e4ytt\u00e4m\u00e4\u00e4n jotain muuta porttia.";
    t[5692] = "Manually edit peers and view banned peers and blocklist";
    t[5693] = "Muokkaa vertaisversioita manuaalisesti ja tarkastele kiellettyj\u00e4 vertaisohjelmia ja estolistaa";
    t[5712] = "Firewalled with Inbound TCP Enabled";
    t[5713] = "Palomuuri, jossa Inbound TCP k\u00e4yt\u00f6ss\u00e4";
    t[5716] = "Open <a href=/confignet#udpconfig>I2P+'s port</a> on your modem, router and/or firewall(s) for better connectivity (ideally both UDP and TCP). More information on how to go about port forwarding can be found at <a href=http://portforward.com/ target=_blank rel=noreferrer class='sitelink external'>portforward.com</a>, in addition to our forums and IRC channels listed below. Note that I2P does not support connecting to the internet via an http or socks proxy [patches welcome!], though you can connect to proxies via I2P itself once connected to the network.";
    t[5717] = "Avaa <a href=/confignet#udpconfig>I2P+:n portti</a> modeemissasi, reitittimess\u00e4si ja/tai palomuureissasi, jotta saat paremman yhteyden (mieluiten sek\u00e4 UDP- ett\u00e4 TCP-protokollien osalta). Lis\u00e4tietoja portinohjauksesta saat <a href=http://portforward.com/ target=_blank rel=noreferrer class='sitelink external'>portforward.com</a>:sta, sek\u00e4 foorumeiltamme ja alla mainituista IRC-kanavistamme. Huomaa, ett\u00e4 I2P ei tue internetiin yhdist\u00e4mist\u00e4 http- tai socks-v\u00e4lityspalvelimen kautta [korjaukset tervetulleita!], mutta voit kuitenkin yhdist\u00e4\u00e4 v\u00e4lityspalvelimiin I2P:n kautta, kun olet yhdistetty verkkoon.";
    t[5730] = "A tunnel filter can provide protection against denial of service attacks, without otherwise interrupting the service for genuine users, either in conjunction with the tunnel throttler or as an alternative strategy. It can also be used to log access to a hosted service to determine if the server is under attack, or simply to log all visitors by I2P destination. Additionally, a filter can function simultaneously as a whitelist and blacklist making it more flexible than the Tunnel Manager's access list controls. Note that multiple server tunnels can share a single filter file if you wish to implement a global filter.";
    t[5731] = "Tunnelisuodatin voi tarjota suojaa palvelunestohy\u00f6kk\u00e4yksi\u00e4 vastaan, ilman ett\u00e4 se keskeytt\u00e4\u00e4 palvelun aitojen k\u00e4ytt\u00e4jien osalta, joko yhdess\u00e4 tunnelinohjaimen kanssa tai vaihtoehtoisena strategiana. Sit\u00e4 voidaan my\u00f6s k\u00e4ytt\u00e4\u00e4 kirjaamaan p\u00e4\u00e4sy\u00e4 is\u00e4nn\u00f6ityyn palveluun, jotta voidaan selvitt\u00e4\u00e4, onko palvelin hy\u00f6kk\u00e4yksen kohteena tai yksinkertaisesti tallentaa kaikki vierailijat I2P m\u00e4\u00e4r\u00e4np\u00e4\u00e4h\u00e4n perustuen. Lis\u00e4ksi suodatin voi toimia samanaikaisesti valko- ja mustalistauksena, mik\u00e4 tekee siit\u00e4 joustavamman kuin Tunnel Managerin p\u00e4\u00e4sylistan hallinta. Huomaa, ett\u00e4 useat palvelintunnelit voivat jakaa yhden suodatintiedoston, jos haluat k\u00e4ytt\u00e4\u00e4 globaalia suodatinta.";
