    t[6026] = "This setting (in milliseconds) allows you to manually configure the delay between router refresh updates run by the Refresh Routers Job. By default the pause between refreshes is determined by the size of the NetDb, and introduces some randomness in the timing to mitigate traffic analysis. For values lower than 2000 milliseconds, increasing the value of <code>router.refreshTimeout</code> is recommended. Note that setting this value below 2000 milliseconds will increase your network traffic and may introduce job lag, and is not recommended for sustained use.";
    t[6027] = "T\u00e4m\u00e4 asetus (millisekunteina) antaa sinulle mahdollisuuden m\u00e4\u00e4ritt\u00e4\u00e4 manuaalisesti viive reititin p\u00e4ivitysten v\u00e4lill\u00e4, jotka suoritetaan P\u00e4ivitetyt Reitittimet -teht\u00e4v\u00e4n avulla. Oletuksena p\u00e4ivitysten v\u00e4lill\u00e4 on tauko, joka m\u00e4\u00e4r\u00e4ytyy NetDb-kannan koon perusteella ja siihen liittyy jonkin verran satunnaisuutta ajoituksessa liikenteen analysoinnin lievent\u00e4miseksi. Alle 2000 millisekunnin arvoilla suositellaan <code>router.refreshTimeout</code> -arvon nostamista. Huomaa, ett\u00e4 t\u00e4m\u00e4n arvon asettaminen alle 2000 millisekunnin lis\u00e4\u00e4 verkkoliikennett\u00e4 ja voi aiheuttaa teht\u00e4vien hidastumista, joten se ei ole suositeltavaa jatkuvaan k\u00e4ytt\u00f6\u00f6n.";
    t[6030] = "Server tunnels, configurable in the <a href=/i2ptunnelmgr>Tunnel Manager</a>, provide a number of ways to limit access to the hosted service. Destination whitelisting, blacklisting, connection throttling, and tunnel filtering are methods provisioned to mitigate denial of service attacks, grant exclusive access to known I2P destinations, and manage traffic to the server.";
    t[6031] = "Palvelin tunnelit, jotka voidaan m\u00e4\u00e4ritt\u00e4\u00e4 <a href=/i2ptunnelmgr>Tunnel Managerissa</a>, tarjoavat useita tapoja rajoittaa p\u00e4\u00e4sy\u00e4 palveluun. M\u00e4\u00e4r\u00e4np\u00e4\u00e4 valko- ja mustalistaus, yhteyksien rajoitus ja tunnelinhallinta ovat menetelmi\u00e4, joiden tarkoituksena on v\u00e4hent\u00e4\u00e4 palvelunestohy\u00f6kk\u00e4yksi\u00e4, my\u00f6nt\u00e4\u00e4 yksinomainen p\u00e4\u00e4sy tunnettuihin I2P m\u00e4\u00e4r\u00e4np\u00e4ihin ja hallita liikennett\u00e4 palvelimelle.";
