    t[6205] = "Yhdistetty kaistanleveyskaavio";
    t[6214] = "Do not reveal this file to unknown users, as it contains sensitive data (100 RouterInfo files) from your own I2P router which potentially could be used by an adversary to decloak your identity. In order to protect your anonymity: you should wait for a few hours/days before sharing the file with your trusted friend. It is also advisable to use this procedure sparingly (no more than once a week).";
    t[6215] = "\u00c4l\u00e4 paljasta t\u00e4t\u00e4 tiedostoa tuntemattomille k\u00e4ytt\u00e4jille, koska se sis\u00e4lt\u00e4\u00e4 arkaluonteisia tietoja (100 RouterInfo-tiedostoa) omasta I2P-reitittimest\u00e4si, jotka potentiaalisesti voivat pahantahtoinen k\u00e4ytt\u00e4\u00e4 dekloakkaamaan identiteettisi. Anonymiteettisi suojelemiseksi: sinun tulisi odottaa muutamia tunteja/p\u00e4ivi\u00e4 ennen kuin jaat tiedoston luotetun yst\u00e4v\u00e4si kanssa. On my\u00f6s suositeltavaa k\u00e4ytt\u00e4\u00e4 t\u00e4t\u00e4 menetelm\u00e4\u00e4 s\u00e4\u00e4steli\u00e4\u00e4sti (enint\u00e4\u00e4n kerran viikossa).";
