    t[6270] = "Determines the maximum number of participating tunnels the router can build. To disable participation completely, set to 0. [Default is 8000, or 2000 if running on Arm or Android]";
    t[6271] = "M\u00e4\u00e4ritt\u00e4\u00e4 enimm\u00e4ism\u00e4\u00e4r\u00e4n solmuja, joiden kanssa reititin voi muodostaa tunnelin. Voit poistaa osallistumisen kokonaan k\u00e4yt\u00f6st\u00e4 asettamalla arvon 0. [Oletusarvo on 8000 tai 2000 jos k\u00e4ytet\u00e4\u00e4n Armin tai Androidin kanssa]";
