    t[6322] = "Outbound to 32000 only, does not listen on this port. Starts at 31000 and will increment until 31999 looking for a free port. To change, see the <a href=https://wrapper.tanukisoftware.com/doc/english/prop-port.html target=_blank rel=noreferrer class='sitelink external'>wrapper documentation</a>.";
    t[6323] = "Ulostuleva vain 32000:een, ei kuuntele t\u00e4t\u00e4 porttia. Alkaa 31000:sta ja lis\u00e4\u00e4ntyy kunnes se l\u00f6yt\u00e4\u00e4 vapaan portin 31999:een asti. Muuttaaksesi, katso <a href=https://wrapper.tanukisoftware.com/doc/english/prop-port.html target=_blank rel=noreferrer class='sitelink external'>k\u00e4\u00e4reasiakirjat</a>.";
