    t[6350] = "This setting determines the number of peers to explore in parallel when the Peer Exploration Job runs [default is 1 peer at a time when more than 3000 peers are known]. Note that increasing this value will increase the bandwidth requirements for the exploration, and setting this value too high may cause excessive message delay and interfere with other services, so use with caution!";
    t[6351] = "T\u00e4m\u00e4 asetus m\u00e4\u00e4ritt\u00e4\u00e4 verkkop\u00e4\u00e4peittelyn suorittaessa tutkittavien vertaisten m\u00e4\u00e4r\u00e4n rinnakkain [oletuksena on 1 verta yht\u00e4aikaa, kun tunnetaan yli 3000 vertaista]. Huomaa, ett\u00e4 t\u00e4m\u00e4n arvon kasvattaminen lis\u00e4\u00e4 kaistanleveyden vaatimuksia verkostotutkimukselle, ja arvon asettaminen liian korkealle voi aiheuttaa liiallista viestien viivett\u00e4 ja h\u00e4irit\u00e4 muita palveluita, joten ole varovainen!";
