    t[6762] = "I2P+ may be slow to integrate into network the first time you run it as it bootstraps into the network and learns of additional peers. The longer your I2P+ router is running, the better it will perform, so try and keep your router on as long as you can, 24/7 if possible! If, after 30 minutes, your <i>Active: [connected/recent]</i> count still has less than 10 peers, or your total number of <i>Integrated</i> peers is less than 5, there are several things you can do to check for problems:";
    t[6763] = "I2P+ voi olla ensimm\u00e4isell\u00e4 k\u00e4ynnistyskerralla hidas integroitumaan verkkoon, kun se k\u00e4ynnist\u00e4\u00e4 sen ja oppii lis\u00e4\u00e4 vertaisryhmi\u00e4. Mit\u00e4 kauemmin I2P+ -reititin on k\u00e4ynniss\u00e4, sit\u00e4 paremmin se toimii, joten pid\u00e4 reititin p\u00e4\u00e4ll\u00e4 niin kauan kuin mahdollista, 24/7 jos mahdollista! Jos 30 minuutin kuluttua <i>Aktiivinen: [liitetty/\u00e4skett\u00e4in]</i> -laskuri on edelleen alle 10 vertaistukea tai yhteens\u00e4 v\u00e4hemm\u00e4n kuin 5 <i>Liitetty</i> vertaistukea, on useita asioita, jotka voit tehd\u00e4 ongelmien tarkistamiseksi:";
