    t[6942] = "High capacity";
    t[6943] = "Suuri kapasiteetti";
    t[6944] = "A java implementation of a Tor client, available as an I2P plugin. Can be used as the default <i>outproxy</i> if configured in the relevant SOCKS or HTTP client tunnel in the <i>Tunnel Manager</i>. Available from <a href=http://stats.i2p/i2p/plugins class=sitelink>http://stats.i2p/i2p/plugins</a>. Source code is available on <a href=https://github.com/i2p/i2p.plugins.orchid class='sitelink external' target=_blank rel=noreferrer>github</a>.";
    t[6945] = "Java-toteutus Tor-asiakkaasta, saatavilla I2P-liit\u00e4nn\u00e4isen\u00e4. Voidaan k\u00e4ytt\u00e4\u00e4 oletuksena <i>ulkoproksyna</i> jos se on m\u00e4\u00e4ritetty asiaankuuluvalle SOCKS- tai HTTP-asiakastunnelille <i>Tunnel Managerissa</i>. Saatavissa osoitteesta<a href=http://stats.i2p/i2p/plugins class=sitelink>http://stats.i2p/i2p/plugins</a>. L\u00e4hdekoodi on saatavilla <a href=https://github.com/i2p/i2p.plugins.orchid class='sitelink external' target=_blank rel=noreferrer>githubista</a>.";
    t[6952] = "IPv4 Addresses";
    t[6953] = "IPv4-osoitteet";
    t[6956] = "This section indicates your average bandwidth speeds and total usage for the session. All values are in bytes per second. You may change your bandwidth limits on the <a href='/config'>Bandwidth Configuration page</a>. The more bandwidth you make available, the more you help the network and improve your own anonymity, so please take the time to review the settings. If you are unsure of your network's speed, using a service such as <a href='http://speedtest.net/'>SpeedTest</a> or similar will give you a good indication of your bandwidth capability. Your upstream share amount (KBps Out) will determine your overall contribution to the network. Bandwidth is <a href='/graphs'>graphed</a> by default.";
    t[6957] = "T\u00e4m\u00e4 osio osoittaa keskim\u00e4\u00e4r\u00e4iset kaistanleveytesi ja kokonaisk\u00e4yt\u00f6n istunnolle. Kaikki arvot ovat tavuina sekunnissa. Voit muuttaa kaistanleveyden rajoituksia <a href='/config'>Kaistanleveysasetukset -sivulla</a>. Mit\u00e4 enemm\u00e4n kaistanleveytt\u00e4 teet k\u00e4ytett\u00e4v\u00e4ksi, sit\u00e4 enemm\u00e4n autat verkkoa ja parannat omaa anonymiteetti\u00e4si, joten ota aikaa arvioidaksesi asetukset. Jos et ole varma verkkosi nopeudesta, palvelun k\u00e4ytt\u00e4minen, kuten <a href='http://speedtest.net/'>SpeedTest</a> tai vastaava, antaa sinulle hyv\u00e4n k\u00e4sityksen kaistanleveyskapasiteetistasi. Yl\u00e4virtasi osuus (KBps -ulko) m\u00e4\u00e4ritt\u00e4\u00e4 kokonaispanoksenne verkossa. Oletusarvoisesti kaistanleveys on <a href='/graphs'>graafisessa muodossa</a>.";
