    t[7004] = "This setting allows you to configure the minimum number of hosted participating tunnels before the router starts to reject tunnel requests based on anticipated bandwidth requirements. [Default is 100 if system is running Android, 800 if system is running on ARM and less than 4 cores available, 1200 if system is running on ARM and 4 or more cores available, otherwise 2500]";
    t[7005] = "T\u00e4m\u00e4 asetus mahdollistaa v\u00e4himm\u00e4ism\u00e4\u00e4r\u00e4n majoitettujen osallistuvien tunneleiden m\u00e4\u00e4r\u00e4n m\u00e4\u00e4ritt\u00e4misen ennen kuin reititin alkaa hyl\u00e4t\u00e4 tunnelipyynt\u00f6j\u00e4 odotettujen kaistanleveyden ja -vaatimusten perusteella. [Oletusarvo on 100, jos j\u00e4rjestelm\u00e4 toimii Androidilla, 800, jos j\u00e4rjestelm\u00e4 toimii ARM:lla ja k\u00e4ytett\u00e4viss\u00e4 on alle 4 ydint\u00e4, 1200, jos j\u00e4rjestelm\u00e4 toimii ARM:lla ja k\u00e4ytett\u00e4viss\u00e4 on 4 tai enemm\u00e4n ydint\u00e4, muuten 2500]";
