    t[7030] = "In order to maintain anonymity, it is recommended to update using the I2P http proxy. If the news or I2P update is hosted on I2P, using the proxy will be necessary.";
    t[7031] = "Anonyymin yll\u00e4pit\u00e4miseksi on suositeltavaa p\u00e4ivitt\u00e4\u00e4 k\u00e4ytt\u00e4m\u00e4ll\u00e4 I2P HTTP -v\u00e4lityspalvelinta. Jos uutiset tai I2P -p\u00e4ivitys is\u00e4nn\u00f6id\u00e4\u00e4n I2P: ss\u00e4, v\u00e4lityspalvelimen k\u00e4ytt\u00e4minen on tarpeen.";
