    t[7158] = "I2P does not work well behind this type of firewall. You will probably not be able to accept inbound connections, which will limit your participation in the network.";
    t[7159] = "I2P ei toimi hyvin t\u00e4llaisen palomuurin takaa. Luultavasti et voi ottaa vastaan sis\u00e4\u00e4ntulevia yhteyksi\u00e4, mik\u00e4 haittaa osallistumistasi verkkoon.";
    t[7166] = "The I2P Client Protocol (I2CP) enables external applications (clients) to communicate with I2P over single TCP socket, by default using port 7654. For more information, see the <a href=https://geti2p.net/en/docs/protocol/i2cp class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7167] = "I2P Client -protokolla (I2CP) mahdollistaa ulkoisille sovelluksille (asiakkaille) kommunikoinnin I2P:n kanssa yhden TCP-liit\u00e4nt\u00e4pisteen kautta, oletuksena porttia 7654 k\u00e4ytt\u00e4en. Lis\u00e4tietoja l\u00f6yd\u00e4t <a href=https://geti2p.net/en/docs/protocol/i2cp class='sitelink external' target=_blank rel=noreferrer>verkkodokumentaatiosta</a>.";
    t[7168] = "Queue Totals";
    t[7169] = "Jonon kokonaissummat";
    t[7170] = "This setting determines which transport takes priority when communicating with peers. By default, NTCP is favored over UDP (SSU). By setting the value to true, UDP will be favored unless a pre-existing NTCP connection exists; when set to always, UDP will always be used regardless of any pre-existing NTCP connection. [Default is false]";
    t[7171] = "T\u00e4m\u00e4 asetus m\u00e4\u00e4ritt\u00e4\u00e4, mik\u00e4 siirto vie etusijan tiedon siirt\u00e4misess\u00e4 vertaisverkoille. Oletusarvoisesti NTCP: t\u00e4 suositaan UDP: n (SSU) sijaan. Asettamalla arvon todeksi UDP: t\u00e4 suositaan, ellei aiemmin k\u00e4yt\u00f6ss\u00e4 ole oleva NTCP-yhteys ole olemassa; kun asetetaan arvoon always, UDP: t\u00e4 k\u00e4ytet\u00e4\u00e4n aina riippumatta mahdollisesta aiemmasta NTCP-yhteydest\u00e4. [Oletusarvo on ep\u00e4tosi]";
