    t[7195] = "Et ole m\u00e4\u00e4ritt\u00e4nyt saapuvan TCP:n is\u00e4nt\u00e4nime\u00e4 ja porttia Verkkoasetukset-sivulla, mutta olet kuitenkin poistanut UDP:n k\u00e4yt\u00f6st\u00e4.";
