    t[7292] = "When set to true, I2P runs without network connectivity, which is helpful if you are constantly restarting the router to test code updates as this prevents network disruption.";
    t[7293] = "Kun arvo on p\u00e4\u00e4ll\u00e4, I2P toimii ilman verkkoyhteytt\u00e4. T\u00e4m\u00e4 on hy\u00f6dyllist\u00e4, jos k\u00e4ynnist\u00e4t reititint\u00e4 jatkuvasti koodip\u00e4ivitysten testaamiseksi, koska se est\u00e4\u00e4 verkkoh\u00e4iri\u00f6it\u00e4.";
    t[7302] = "Updating IP address";
    t[7303] = "P\u00e4ivitet\u00e4\u00e4n IP-osoite";
    t[7308] = "SSU [IPv6 Only] with Introducers";
    t[7309] = "IPv6 vain SSU, esittelij\u00e4t";
    t[7312] = "SSU (Secure Semi-reliable UDP) is an I2P network transport providing encrypted, connection-oriented, point-to-point connections, in addition to IP address detection and NAT traversal services. For more information, see the <a href=https://geti2p.net/en/docs/transport/ssu class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7313] = "SSU (turvallinen puoliluotettava UDP) on I2P-verkkoliikenne, joka tarjoaa salattuja, yhteyteen perustuvia, pisteest\u00e4 pisteeseen -yhteyksi\u00e4, lis\u00e4ksi se tarjoaa IP-osoitteen havaitsemisen ja NAT-kulunpalvelut. Lis\u00e4tietoja l\u00f6yd\u00e4t <a href=https://geti2p.net/en/docs/transport/ssu class='sitelink external' target=_blank rel=noreferrer>verkkodokumentaatiosta</a>.";
    t[7314] = "Congestion window";
    t[7315] = "Ruuhkaikkuna";
    t[7326] = "Use Proxy to Reseed";
    t[7327] = "K\u00e4yt\u00e4 v\u00e4lityspalvelinta uudelleenkytkemiseen";
    t[7328] = "Until the advent of I2P integration in <a href=http://www.vuze.com/ target=_blank rel=noreferrer class='sitelink external'>Vuze</a>, it wasn't possible to download torrents that weren't hosted on the I2P network. However, now that Vuze (and latterly <a href=https://www.biglybt.com/ target=_blank rel=noreferrer class='sitelink external'>Bigly</a>) allow users to share non-I2P torrents on I2P, non-I2P torrents can be downloaded over I2P if Vuze/Bigly users have chosen to make content available to the I2P network. Popular torrents with a large number of peers are more likely to be accessible via I2P; to determine if the content is available, add the torrent link, magnet or infohash to your I2P-enabled BitTorrent client.";
    t[7329] = "Ennen I2P-integraatiota <a href=http://www.vuze.com/ target=_blank rel=noreferrer class='sitelink external'>Vuze</a>:ssa ei ollut mahdollista ladata torrentteja, jotka eiv\u00e4t ole I2P-verkossa. Kuitenkin nyt, kun Vuze (ja my\u00f6hemmin <a href=https://www.biglybt.com/ target=_blank rel=noreferrer class='sitelink external'>Bigly</a>) sallivat k\u00e4ytt\u00e4jien jakaa non-I2P torrentteja I2P:ll\u00e4, non-I2P torrentteja voidaan ladata I2P:n yli, jos Vuze/Bigly k\u00e4ytt\u00e4j\u00e4t ovat valinneet jakaa sis\u00e4lt\u00f6\u00e4 I2P-verkolle. Suositut torrentit suurella m\u00e4\u00e4r\u00e4ll\u00e4 vertaisia ovat todenn\u00e4k\u00f6isemmin saatavilla I2P:n kautta; tarkista saatavuus lis\u00e4\u00e4m\u00e4ll\u00e4 torrent-linkki, magneetti tai infohash I2P-yhteensopivaan BitTorrent-asiakasohjelmaasi.";
