    t[7428] = "This setting (in hours) determines how old a RouterInfo in the NetDb is (its last known publication date) before it's classified as stale and deleted. [Default is 28 hours unless the router is a Floodfill, in which case the default is 8 hours]";
    t[7429] = "T\u00e4m\u00e4 asetus (tunteina) m\u00e4\u00e4ritt\u00e4\u00e4, kuinka vanha RouterInfon NetDb:ss\u00e4 (sen viimeisin tunnettu julkaisup\u00e4iv\u00e4) pit\u00e4\u00e4 olla, ennen kuin se luokitellaan vanhaksi ja poistetaan. [Oletusarvo on 28 tuntia, ellei reititin ole t\u00e4ytt\u00f6reititin, jolloin oletusarvo on 8 tuntia]";
