    t[7443] = "Reitittimen ohje ja usein kysytyt kysymykset";
    t[7444] = "If a <i>Registration Authentication</i> string is requested, you can find it on the <a href='http://127.0.0.1:7657/i2ptunnel/register?tunnel=3'>Registration Authentication page</a> linked from the <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>. Registration authentication ensures only the owner is able to register or otherwise manage the hostname, and is required on stats.i2p and reg.i2p.";
    t[7445] = "Jos pyydet\u00e4\u00e4n <i>rekister\u00f6intitunnistautumismerkkijonoa</i>, voit l\u00f6yt\u00e4\u00e4 sen <a href='http://127.0.0.1:7657/i2ptunnel/register?tunnel=3'>rekister\u00f6intitunnistautumissivulta</a>, joka on linkitetty <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration</a> -sivulta. Rekister\u00f6intitunnistautuminen varmistaa, ett\u00e4 vain omistaja voi rekister\u00f6id\u00e4 tai hallinnoida verkkosivun osoitetta ja sit\u00e4 vaaditaan stats.i2p- ja reg.i2p-sivustoilla.";
    t[7448] = "News &amp; Updates";
    t[7449] = "Uutiset &amp; P\u00e4ivitykset";
    t[7452] = "[Linux/Unix/Solaris] If you can't start the router with <code>i2p/i2prouter start</code> try the <code>runplain.sh</code> script in the same directory. Root privileges are never required to run I2P+. If you need to compile the <a href=http://i2p-projekt.i2p/jbigi.html target=_blank rel=noreferrer>jBigi library</a> (which is necessary in rare cases), consult the documentation, visit the forums, or visit <a href=irc://127.0.0.1:6668/saltR class=chatlink>the I2P+ channel</a> or <a href=irc://127.0.0.1:6668/i2p-dev class=chatlink>IRC developer channel</a>.";
    t[7453] = "[Linux/Unix/Solaris] Jos et saa reititint\u00e4 k\u00e4yntiin <code>i2p/i2prouter start</code>, kokeile samaan hakemistoon sijoitettua <code>runplain.sh</code> -skripti\u00e4. I2P+:n suorittaminen ei koskaan vaadi root-k\u00e4ytt\u00f6oikeuksia. Jos tarvitset <a href=http://i2p-projekt.i2p/jbigi.html target=_blank rel=noreferrer>jBigi-kirjaston</a> (mik\u00e4 on tarpeen harvinaisissa tapauksissa) k\u00e4\u00e4nt\u00e4mist\u00e4, katso dokumentaatiota, k\u00e4y foorumeilla tai vieraile <a href=irc://127.0.0.1:6668/saltR class=chatlink>I2P+ -kanavalla</a> tai <a href=irc://127.0.0.1:6668/i2p-dev class=chatlink>IRC-kehitt\u00e4j\u00e4kanavalla</a>.";
    t[7454] = "Top 50 peers by transit tunnel requests";
    t[7455] = "50 parasta vertaista liikennetunnelipyynt\u00f6jen mukaan";
    t[7458] = "Information defining the unique identity of a router on the network which includes its IP address (or the IP addresses of intermediate introducers) and listening port, public signing and encryption keys. Router identities correlate to peers in the NetDB. Also referred to as a <i>RouterInfo</i>.";
    t[7459] = "Tieto, joka m\u00e4\u00e4rittelee reitittimen yksil\u00f6llisen tunnisteen verkossa, mukaan lukien IP-osoitteensa (tai v\u00e4litt\u00e4vien johdantolaitteiden IP-osoitteet) ja kuunteluportin, julkiset allekirjoitus- ja salausavaimet. Reitittimen tunnisteet vastaavat vertaisia \u200b\u200bNetDB:ss\u00e4. My\u00f6s kutsutaan nimell\u00e4 <i>RouterInfo</i>.";
    t[7462] = "{0} transit tunnel still active";
