    t[7690] = "A distributed database containing router contact information (RouterInfos) and destination contact information (LeaseSets). A single router maintains its own (partial) database for communicating with other routers on the network; no single router will maintain a list of all routers. The RouterInfos are stored on disk and read into memory when the router starts, or when new RouterInfos are acquired. Also referred to as the <i>NetDb</i>. For more information, see the <a href=https://geti2p.net/en/docs/how/network-database class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7691] = "Hajautettuun tietokantaan tallennetaan reitittimen yhteystiedot (RouterInfos) ja m\u00e4\u00e4r\u00e4np\u00e4\u00e4n yhteystiedot (LeaseSets). Yksi reititin hallitsee omaa (osittaista) tietokantaansa kommunikoidessaan muiden reitittimien kanssa verkossa; yksik\u00e4\u00e4n reititin ei yll\u00e4pid\u00e4 kaikkien reitittimien luetteloa. RouterInfos tallennetaan levylle ja luetaan muistiin, kun reititin k\u00e4ynnistyy, tai kun hankitaan uusia RouterInfoita. Sit\u00e4 kutsutaan my\u00f6s nimell\u00e4 <i>NetDb</i>. Lis\u00e4tietoja on saatavilla <a href=https://geti2p.net/en/docs/how/network-database class='sitelink external' target=_blank rel=noreferrer>verkkodokumentaatiossa</a>.";
    t[7692] = "Address";
    t[7693] = "Osoite";
    t[7694] = "A threshold is defined by the number of connection attempts a remote destination is permitted to perform over a specified number of seconds before a \"breach\" occurs.";
    t[7695] = "Kynnysarvo m\u00e4\u00e4ritell\u00e4\u00e4n et\u00e4kohteen sallitusta yhteydenmuodostusyritt\u00e4misest\u00e4 tietyn sekuntim\u00e4\u00e4r\u00e4n aikana ennen kuin \"rikkomus\" tapahtuu.";
    t[7704] = "Clearnet normally refers to the publicly accessible internet, the opposite of the darknet that typically describes the encrypted, anonymous services built on I2P, Tor etc. For more information, see the <a href=https://en.wikipedia.org/wiki/Clearnet_(networking) class='sitelink external' target=_blank rel=noreferrer>Wikipedia article</a>.";
    t[7705] = "Clearnet viittaa yleens\u00e4 julkisesti saatavilla olevaan internetiin, joka on vastakohta pime\u00e4lle verkolle, joka tyypillisesti kuvaa I2P:ll\u00e4, Torilla jne. toteutettuja salattuja nimett\u00f6mi\u00e4 palveluita. Lis\u00e4tietoja l\u00f6yd\u00e4t <a href=https://en.wikipedia.org/wiki/Clearnet_(networking) class='sitelink external' target=_blank rel=noreferrer>Wikipedia-artikkelista</a>.";
