    t[7818] = "Defines the maximum number of parallel <a href=/jobs>jobs</a> that can be run. The default value is determined by the amount of memory allocated to the JVM via <code>wrapper.config</code>, and is set at 3 for less than 64MB, 4 for less than 256M, or 5 for more than 256MB. Note: A change to this setting requires a restart of the router.";
    t[7819] = "M\u00e4\u00e4ritt\u00e4\u00e4 samanaikaisesti suoritettavien <a href=/jobs>teht\u00e4vien</a> enimm\u00e4ism\u00e4\u00e4r\u00e4n. Oletusarvo m\u00e4\u00e4ritet\u00e4\u00e4n JVM:lle varatun muistin mukaan <b>wrapper.config</b>:n kautta ja on asetettu arvoon 3, jos muistia on alle 64 Mt, 4, jos muistia on alle 256 Mt, tai 5, jos muistia on yli 256 Mt. Huomaa: Muutoksen tekeminen t\u00e4h\u00e4n asetukseen vaatii reitittimen uudelleenk\u00e4ynnistyksen.";
