    t[7990] = "A router on the network tasked with providing and receiving information about other routers and services on the network. The current minimum share bandwidth for a router to be considered as capable of performing floodfill duties is 128 KBytes/sec, though it's possible to override this requirement and force a router to be a floodfill on the <a href=/configadvanced>Advanced Configuration page</a>. For more information, see the <a href=https://geti2p.net/en/docs/how/network-database#floodfill class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7991] = "Verkossa oleva reititin, jolle on annettu teht\u00e4v\u00e4ksi tarjota ja vastaanottaa tietoa muista reitittimist\u00e4 sek\u00e4 palveluista verkossa. Reitittimen, jotta kyett\u00e4isiin pit\u00e4m\u00e4\u00e4n sit\u00e4 potentiaalisena tulvanjakofunktioiden suoritukseen, on v\u00e4hint\u00e4\u00e4nkin jaettava kaistanleveys 128 Kt/s, vaikka vaatimuksen voikin ohittaa ja pakottaa reitittimen toimimaan tulvanjakona <a href=/configadvanced>Edistyneell\u00e4 kokoonpanosivulla</a>. Lis\u00e4tietoja l\u00f6yd\u00e4t <a href=https://geti2p.net/en/docs/how/network-database#floodfill class='sitelink external' target=_blank rel=noreferrer>verkkodokumentaatiosta</a>.";
