    t[8256] = "Configuring I2P+: Network, Firefox, Tunnel Manager";
    t[8257] = "I2P+:n asetusten m\u00e4\u00e4ritt\u00e4minen: verkko, Firefox, tunnelinhallinta";
    t[8258] = "If you think you have opened up your firewall and I2P still thinks you are firewalled, remember that you may have multiple firewalls, for example both software packages and external hardware routers.";
    t[8259] = "Jos luulet avanneesi palomuuriin ja I2P edelleen n\u00e4kee sinut palomuuratuksi, muista ett\u00e4 voi olla useampia palomuureja, kuten esimerkiksi sek\u00e4 ohjelmistopohjaisia ett\u00e4 ulkoisia laiteohjaimia.";
    t[8270] = "The keyword <i class=example>deny</i>. This threshold is always breached, i.e. no connection attempts will be allowed.";
    t[8271] = "Avainsana <i class=example>deny</i>. T\u00e4t\u00e4 kynnyst\u00e4 rikotaan aina, eli mit\u00e4\u00e4n yhteysyrityksi\u00e4 ei sallita.";
    t[8282] = "log visitors making 90 or more connections a minute";
    t[8283] = "lokita vierailijat, jotka tekev\u00e4t 90 tai enemm\u00e4n yhteyksi\u00e4 minuutissa";
    t[8286] = "You have configured inbound TCP, however your UDP port is firewalled, and therefore it is likely that your TCP port is firewalled as well.";
    t[8287] = "Olet sallinut sis\u00e4\u00e4ntulevan TCP -liikenteen. UDP -porttisi on kuitenkin palomuurin takana ja siksi on luultavaa, ett\u00e4 my\u00f6s TCP -porttisi ovat.";
    t[8296] = "This is the number of peers your router will use for network database inquiries. These are usually the <i>floodfill</i> routers which are responsible for maintaining network integrity. Your well integrated peers are shown on the bottom of the <a href='/profiles'>Profiles page</a>.";
    t[8297] = "T\u00e4m\u00e4 on vertaisverkkojen m\u00e4\u00e4r\u00e4, jota reitittimesi k\u00e4ytt\u00e4\u00e4 verkko-tietokantakyselyiss\u00e4. N\u00e4m\u00e4 ovat yleens\u00e4 tulvasuojauksen reitittimi\u00e4, jotka vastaavat verkkojen eheyden yll\u00e4pidosta. Hyvin integroidut k\u00e4ytt\u00e4j\u00e4si n\u00e4kyv\u00e4t alareunassa <a href='/profiles'>Profiilit-sivulla</a>.";
    t[8298] = "Manage Router webapps";
    t[8299] = "Hallitse reitittimen verkkosovelluksia";
    t[8302] = "Outbound TCP from random high ports to arbitrary remote TCP ports.";
    t[8303] = "L\u00e4htev\u00e4 TCP satunnaiselta korkealta portilta k\u00e4ytt\u00e4j\u00e4n m\u00e4\u00e4ritt\u00e4miin TCP-portteihin.";
    t[8310] = "When you start I2P, it may take a few minutes to bootstrap (integrate) your router into the network and find additional peers, so please be patient.";
    t[8311] = "Kun k\u00e4ynnist\u00e4t I2P:n, reitittimen k\u00e4ynnist\u00e4minen (integroiminen) verkkoon ja muiden vertaiskumppanien l\u00f6yt\u00e4minen voi kest\u00e4\u00e4 muutaman minuutin, joten ole k\u00e4rsiv\u00e4llinen.";
    t[8318] = "No file specified. Please select a valid .zip or .su3 file to reseed from.";
