    t[8334] = "Function";
    t[8335] = "Toiminto";
    t[8336] = "On the I2P network, remotely hosted services can be accessed using a <a href=https://en.wikipedia.org/wiki/Base32 target=_blank rel=noreferrer class='sitelink external'>Base32</a> address ending in \".b32.i2p\", a <i>destination</i> represented as a long <a href=https://en.wikipedia.org/wiki/Base64 class='sitelink external'>Base64</a> string, or more usually by using an .i2p domain. A destination is I2P's equivalent to an IP address, and is shown on the <a href='/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>. You can share your b32.i2p address to allow others to access to your website until you've registered your own .i2p domain.";
    t[8337] = "I2P-verkossa et\u00e4n\u00e4 sijaitseviin palveluihin p\u00e4\u00e4st\u00e4\u00e4n k\u00e4siksi k\u00e4ytt\u00e4m\u00e4ll\u00e4 \".b32.i2p\"-p\u00e4\u00e4ttyv\u00e4\u00e4 <a href=https://en.wikipedia.org/wiki/Base32 target=_blank rel=noreferrer class='sitelink external'>Base32</a>-osoitetta, joka on esitetty pitk\u00e4n\u00e4 <a href=https://en.wikipedia.org/wiki/Base64 class='sitelink external'>Base64</a>-merkkijonona tai yleisimmin k\u00e4ytt\u00e4m\u00e4ll\u00e4 .i2p-verkkotunnusta. Verkkotunnus vastaa I2P:ss\u00e4 IP-osoitetta, ja se n\u00e4kyy <a href='/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a> :lla. Voit jakaa b32.i2p-osoitteesi, jotta muut p\u00e4\u00e4sev\u00e4t verkkosivustoosi, kunnes rekister\u00f6it oman .i2p-verkkotunnuksesi.";
