    t[8410] = "To disable directory listings, find the entry for <code>org.eclipse.jetty.servlet.Default.dirAllowed</code> in the <code>base-context.xml</code> file, located in the <code>eepsite/contexts</code> folder (just above docroot folder), and change 'true' to 'false' immediately underneath. To apply the change immediately, stop and restart the <i>I2P Webserver</i> client on the <a href=/configclients>Client Configuration page</a>. You can also drop an empty <code>index.html</code> file in any exposed directory to suppress directory listings for that location.";
    t[8411] = "Hakemistoluettelojen poistamiseksi etsi tiedoston <code>base-context.xml</code> kohta <code>org.eclipse.jetty.servlet.Default.dirAllowed</code>, joka sijaitsee kansiossa <code>eepsite/contexts</code> (suoraan kohteen docroot-kansio yl\u00e4puolella) ja muuta sen arvo 'true' lukemasta 'false' lukioksi. Muutos otetaan v\u00e4litt\u00f6m\u00e4sti k\u00e4ytt\u00f6\u00f6n, kun pys\u00e4yt\u00e4t ja k\u00e4ynnist\u00e4t <i>I2P-palvelin</i> asiakkaan sivulla <a href=/configclients>Asiakaskonfiguraatiosivu</a>. Voit my\u00f6s pudottaa tyhj\u00e4n <code>index.html</code>-tiedoston mihin tahansa alttiiksi j\u00e4\u00e4v\u00e4\u00e4n kansioon est\u00e4\u00e4ksesi hakemistoluettelot t\u00e4ss\u00e4 sijainnissa.";
