    t[8554] = "If you're not using IE, it's likely that your browser is pretending to be IE; please configure your browser (or proxy) to use a different User Agent string if you'd like to access the console themes.";
    t[8555] = "Ellet k\u00e4yt\u00e4 IE:t\u00e4, selaimesi luultavasti teeskentelee olevansa IE. Jos haluat k\u00e4ytt\u00e4\u00e4 ohjauspaneelin teemoja, aseta selaimesi (tai proxysi) User Agent -tiedoksi jotain muuta.";
    t[8564] = "Privacy-focused Clearnet Search Engine";
    t[8565] = "Yksityisyyteen keskittyv\u00e4 Clearnet-hakukone";
    t[8572] = "<a href=/logs>Logs</a> may help resolve a problem. You may wish to paste excerpts in a <a href=http://i2pforum.i2p/ target=_blank rel=noreferrer>forum</a> for help, or perhaps <a href=http://cake.i2p/pastebin/ target=_blank rel=noreferrer class='sitelink external'>paste</a> it instead and reference the link on IRC for help.";
    t[8573] = "<a href=/logs>Logit</a> voivat auttaa ratkaisemaan ongelman. Saatamme haluta liitt\u00e4\u00e4 lainauksia <a href=http://i2pforum.i2p/ target=_blank rel=noreferrer>foorumiin</a> apua varten, tai mahdollisesti <a href=http://cake.i2p/pastebin/ target=_blank rel=noreferrer class='sitelink external'>liitt\u00e4\u00e4</a> sen sijaan ja viitata linkkiin IRC:ss\u00e4 apua varten.";
    t[8574] = "Plugins signed with the cryptographic key of the developer are the recommended format, but if you wish to install unsigned plugins (.zip) you can set this to true. Note that you may still encounter issues attempting to install an unsigned plugin if the developer has included additional checks in the plugin build process.";
    t[8575] = "Kehitt\u00e4j\u00e4n kryptografisella avaimella allekirjoitetut liit\u00e4nn\u00e4iset ovat suositeltu muoto, mutta jos haluat asentaa allekirjoittamattomia liit\u00e4nn\u00e4isi\u00e4 (.zip), voit asettaa t\u00e4m\u00e4n arvoon \"true\". Huomaa, ett\u00e4 saatat silti kohdata ongelmia yritt\u00e4ess\u00e4si asentaa allekirjoittamatonta liit\u00e4nn\u00e4ist\u00e4, jos kehitt\u00e4j\u00e4 on sis\u00e4llytt\u00e4nyt lis\u00e4tarkistuksia liit\u00e4nn\u00e4isen rakennusprosessiin.";
    t[8578] = "If you are running a standalone Tor instance locally, you may use it by configuring I2P to use: <i>Proxy type:</i> <code>SOCKS 5</code> <i>Host:</i> <code>127.0.0.1</code> <i>Port:</i> <code>9050</code>.";
    t[8579] = "Jos k\u00e4yt\u00e4t paikallista Tor-instanssia, voit k\u00e4ytt\u00e4\u00e4 sit\u00e4 m\u00e4\u00e4ritt\u00e4m\u00e4ll\u00e4 I2P:n k\u00e4ytt\u00e4m\u00e4\u00e4n: <i>V\u00e4lityspalvelimen tyyppi:</i> <code>SOCKS 5</code> <i>Sijainti:</i> <code>127.0.0.1</code> <i>Portti:</i> <code>9050</code>.";
    t[8584] = "Select the language to be used for the router console and web applications (<a href=/webmail target=_blank rel=noreferrer>webmail</a>, <a href=/torrents target=_blank rel=noreferrer>torrents</a>, <a href=/i2ptunnelmgr target=_blank rel=noreferrer>tunnel manager</a> etc). If you wish to change the language in future, change the router console theme, or configure a password to access the console, you may do so on the <a href=/configui target=_blank rel=noreferrer>User Interface configuration page</a>.";
    t[8585] = "Valitse k\u00e4ytett\u00e4v\u00e4 kieli reitittimen konsolissa ja verkkosovelluksissa (<a href=/webmail target=_blank rel=noreferrer>webmail</a>, <a href=/torrents target=_blank rel=noreferrer>torrents</a>, <a href=/i2ptunnelmgr target=_blank rel=noreferrer>tunnelin hallinta</a> jne). Jos haluat vaihtaa kielt\u00e4 tulevaisuudessa, vaihtaa reitittimen konsoliteemaa tai m\u00e4\u00e4ritt\u00e4\u00e4 salasanan konsoliin p\u00e4\u00e4semiseksi, voit tehd\u00e4 sen <a href=/configui target=_blank rel=noreferrer>K\u00e4ytt\u00f6liittym\u00e4n konfigurointisivulla</a>.";
