    t[9052] = "Ready";
    t[9053] = "Valmis";
    t[9056] = "These are the local services provided by your router. They may be clients started through the <a href='/i2ptunnelmgr'>Tunnel Manager</a> or external programs connecting through SAM, BOB, or directly to I2CP. By default, most of your client services (mail, http proxy, IRC) will share the same set of tunnels and be listed as <i>Shared Clients</i> and <i>Shared Clients(DSA)</i>, which enhances anonymity by blending the traffic from all shared services, and reduces the overhead required to build and maintain tunnels. However, if you experience a tunnel failure, all your services will go offline at the same time, so in some scenarios you may wish to configure client services to use their own set of tunnels. This can be done by unchecking the <i>Share tunnels with other clients&hellip;</i> option listed under <i>Shared Clients</i> on the configuration page of the relevant client service in the Tunnel Manager, after which you will need to restart the client service from the <a href='/i2ptunnelmgr'>main Tunnel Manager page</a>.";
    t[9057] = "N\u00e4m\u00e4 ovat reitittimesi tarjoamat paikalliset palvelut. Ne voivat olla asiakkaita, jotka on k\u00e4ynnistetty <a href='/i2ptunnelmgr'>Tunnelin hallintaohjelmassa</a> tai ulkoisia ohjelmia, jotka yhdist\u00e4v\u00e4t SAMin, BOBin kautta tai suoraan I2CP:hen. Oletuksena useimmat asiakaspalvelut (s\u00e4hk\u00f6posti, http-v\u00e4lityspalvelin, IRC) jakavat saman joukon tunneleita ja ne n\u00e4kyv\u00e4t listattuna <i>Jakamattomat asiakkaat</i> ja <i>Jakamattomat asiakkaat (DSA)</i>, mik\u00e4 parantaa anonymiteettia sekoittamalla liikenteen kaikista jaetuilta palveluilta ja v\u00e4hent\u00e4\u00e4 tunneleiden rakentamiseen ja yll\u00e4pit\u00e4miseen tarvittavaa yl\u00e4kantaa. Jos kuitenkin koet tunnelevian, kaikki palvelusi menev\u00e4t offline-tilaan samanaikaisesti. Siksi joissakin tilanteissa voi olla tarpeen m\u00e4\u00e4ritt\u00e4\u00e4 asiakaspalvelut k\u00e4ytt\u00e4m\u00e4\u00e4n omaa joukkoaan tunneleita. T\u00e4m\u00e4 voidaan tehd\u00e4 poistamalla valinta <i>Jaa tunneleita muiden asiakkaiden kanssa&hellip;</i> -vaihtoehdosta <i>Jakamattomat asiakkaat</i> -kohdassa kyseisen asiakaspalvelun m\u00e4\u00e4ritt\u00e4missivulla Tunnelin hallintaohjelmassa. T\u00e4m\u00e4n j\u00e4lkeen sinun tulee k\u00e4ynnist\u00e4\u00e4 asiakaspalvelu uudelleen <a href='/i2ptunnelmgr'>p\u00e4\u00e4-Tunnelin hallintaohjelman sivulta</a>.";
