    t[9240] = "A simple CGI application that takes a hostname as a parameter and returns a 301 redirect to the proper URL with a <code>?i2paddresshelper=key</code> string appended. The HTTP proxy will interpret the appended string and use the key as the actual destination. In addition, the proxy will cache the key so the address helper is not necessary until restart, and offer the option to add the resolved address to the addressbook.";
    t[9241] = "Yksinkertainen CGI-sovellus, joka ottaa is\u00e4nt\u00e4nimen parametrina ja palauttaa 301 uudelleenohjauksen oikeaan URL-osoitteeseen, johon on lis\u00e4tty <code>?i2paddresshelper=key</code> -merkkijono. HTTP-v\u00e4lityspalvelin tulkitsee lis\u00e4tyn merkkijonon ja k\u00e4ytt\u00e4\u00e4 avainta todellisena kohdeosoitteena. Lis\u00e4ksi v\u00e4lityspalvelin v\u00e4limuistaa avaimen, joten osoitteen apulaite ei ole tarpeellinen ennen uudelleenk\u00e4ynnistyst\u00e4, ja se tarjoaa mahdollisuuden lis\u00e4t\u00e4 ratkaistu osoite osoitekirjaan.";
