    t[9292] = "This setting (in minutes) allows you to manually configure how long to wait after startup before RouterInfos in the NetDb are checked for validity, after which point only valid routers will be accepted for inclusion. When the validation occurs, expired RouterInfos and unresponsive peers only accessible via SSU will be removed from the NetDb. [Default is 60 minutes] Note: This setting has no bearing on older routers (older than 0.9.29 by default) which are removed from the NetDb and banned for the router session as soon as a NetDb store is attempted.";
    t[9293] = "Perustusajankohdan j\u00e4lkeen voit t\u00e4ss\u00e4 asetuksessa (minuutteina) m\u00e4\u00e4ritt\u00e4\u00e4 kuinka kauan odotetaan ennen kuin NetDb:n RouterInfos tutkitaan niiden p\u00e4tem\u00e4tt\u00f6myyden varalle, jonka j\u00e4lkeen vain p\u00e4tev\u00e4t reitittimet hyv\u00e4ksyt\u00e4\u00e4n mukaan. Kun tarkistus tehd\u00e4\u00e4n, p\u00e4\u00e4ttyneet RouterInfos ja huonosti reagoivat vertaiset, joihin on p\u00e4\u00e4sy vain SSU:n kautta, poistetaan NetDb:st\u00e4. [Oletusarvo on 60 minuuttia] Huomaa: T\u00e4m\u00e4 asetus ei vaikuta vanhempiin reitittimiin (oletuksena vanhempi kuin 0.9.29), jotka poistetaan NetDb:st\u00e4 ja estet\u00e4\u00e4n reititinistunnosta heti kun NetDb-varastoa yritet\u00e4\u00e4n.";
