    t[9354] = "Reseeding is the bootstrapping process used to find other routers when you first install I2P, or when your router has too few router references remaining. The default settings will work for most people. Change these only if HTTPS is blocked by a restrictive firewall and reseed has failed.";
    t[9355] = "Reseed\u00f6inti on k\u00e4ynnistysprosessi, jota k\u00e4ytet\u00e4\u00e4n muiden reitittimien l\u00f6yt\u00e4miseen, kun asennat I2P: n ensimm\u00e4ist\u00e4 kertaa tai kun reitittimell\u00e4si on liian v\u00e4h\u00e4n reitittimen viitteit\u00e4 j\u00e4ljell\u00e4. Oletusasetukset toimivat useimmille ihmisille. Muuta n\u00e4it\u00e4 vain, jos HTTPS on estetty tiukalla palomuurilla ja reseedit ep\u00e4onnistuvat.";
    t[9362] = "This setting, when enabled, modifies the maximum additional random pong delay introduced for ping-enabled servers, if <code>i2p.streaming.enablePongDelay</code> is also enabled. Unless explicitly set, the default value of 50ms will be used.";
    t[9363] = "T\u00e4m\u00e4 asetus muuttaa maksimaalisen ylim\u00e4\u00e4r\u00e4isen satunnaisen pong-viiveen, joka esitell\u00e4\u00e4n, jos ping-palvelimet ovat k\u00e4yt\u00f6ss\u00e4 ja <code>i2p.streaming.enablePongDelay</code> on my\u00f6s k\u00e4yt\u00f6ss\u00e4. Ellei toisin m\u00e4\u00e4ritetty, k\u00e4ytet\u00e4\u00e4n 50 ms:n oletusarvoa.";
