    t[9474] = "Your I2P+ router by default contributes to the network by routing internal, end-to-end encrypted traffic for other routers, known as <i>participation</i>. Bandwidth participation improves the anonymity level of all users on the network and maximizes your download speed.";
    t[9475] = "Oletusarvoisesti I2P+ -reitittimesi osallistuu verkkoon reititt\u00e4m\u00e4ll\u00e4 sis\u00e4ist\u00e4 ja p\u00e4\u00e4st\u00e4 p\u00e4\u00e4h\u00e4n salattua liikennett\u00e4 muiden reitittimien puolesta. Kaistanleveyden osallistuminen parantaa kaikkien k\u00e4ytt\u00e4jien anonymiteettitasoa verkossa ja maksimoi latausnopeutesi.";
    t[9476] = "This setting permits the configuration of alternative NTP servers required to ensure that your router maintains accurate clock time. [Default is 0.pool.ntp.org,1.pool.ntp.org,2.pool.ntp.org]";
    t[9477] = "T\u00e4m\u00e4 asetus mahdollistaa vaihtoehtoisten NTP-palvelinten m\u00e4\u00e4ritt\u00e4misen, joita tarvitaan varmistamaan, ett\u00e4 reititin yll\u00e4pit\u00e4\u00e4 tarkkaa kellonaikaa. [Oletuksena 0.pool.ntp.org,1.pool.ntp.org,2.pool.ntp.org]";
    t[9484] = "Optimize your images";
    t[9485] = "Optimoi kuvat";
    t[9488] = "Note that the profiler relies on sustained client tunnel usage to accurately profile peers.";
    t[9489] = "Huomaa, ett\u00e4 profiloija luottaa jatkuvaan asiakastunnelin k\u00e4ytt\u00f6\u00f6n profiloidakseen vertaisia \u200b\u200btarkasti.";
    t[9492] = "If you are in a hurry and can't wait a few hours, you can tell people to use a \"jump\" address helper redirection service. This will usually work within a few minutes of your registering your hostname on the same site. Test it yourself first by entering <code>http://stats.i2p/cgi-bin/jump.cgi?a=<i>yourchosenhostname.i2p</i></code> into your browser. Once it is working, you can tell others to use it.";
    t[9493] = "Jos olet kiireinen etk\u00e4 voi odottaa muutamaa tuntia, voit kehottaa ihmisi\u00e4 k\u00e4ytt\u00e4m\u00e4\u00e4n \"hyppy\"-osoitteen avustavaa uudelleenohjauspalvelua. T\u00e4m\u00e4 toimii yleens\u00e4 muutamassa minuutissa oman verkkosivun osoitteen rekister\u00f6imisen j\u00e4lkeen samalla sivustolla. Testaa se ensin itse sy\u00f6tt\u00e4m\u00e4ll\u00e4 <code>http://stats.i2p/cgi-bin/jump.cgi?a=<i>valitsemasiomain.nimi.i2p</i></code> selaimessasi. Kun se toimii, voit kertoa muille k\u00e4ytt\u00e4\u00e4 sit\u00e4.";
