    t[9630] = "Tunnels built by other routers through your router. This may vary widely depending on network demand, your shared bandwidth, and amount of locally-generated traffic. The recommended method for limiting participating tunnels is to change your share percentage on the <a  href='/config'>Bandwidth Configuration page</a>. You may also limit the total number by setting <code>router.maxParticipatingTunnels=nnn</code> on the <a href='/configadvanced'>Advanced configuration page</a>. <a href='/configstats#tunnel.participatingTunnels'>[Enable graphing]</a>.";
    t[9631] = "Muiden reitittimien l\u00e4pi rakennetut tunnelit reitittimell\u00e4si. T\u00e4m\u00e4 voi vaihdella suuresti riippuen verkon tarpeesta, jaetusta kaistanleveydest\u00e4si ja paikallisesti tuotetun liikenteen m\u00e4\u00e4r\u00e4st\u00e4. Osallistuvien tunnelien rajoittamiseksi suositeltu menetelm\u00e4 on muuttaa osuusprosenttia <a  href='/config'>Bandwidth Configuration sivulla</a>. Voit my\u00f6s rajoittaa kokonaislukum\u00e4\u00e4r\u00e4\u00e4 asettamalla <code>router.maxParticipatingTunnels=nnn</code> <a href='/configadvanced'>Advanced configuration sivulla</a>. <a href='/configstats#tunnel.participatingTunnels'>[Enable graphing]</a>.";
