    t[10038] = "To configure an alternative webserver for use on I2P, you can either use the existing webserver tunnel and <a href=/configclients>disable the default webserver</a> from running, or create a new HTTP Server tunnel in the <a href=/i2ptunnelmgr>Tunnel Manager</a>. Ensure that the webserver's <i>listening port</i> is also configured in the Tunnel Manager settings. For example, if your webserver is listening by default on address 127.0.0.1 port 80, you'd also need to ensure that the <i>Target port</i> in the Tunnel Manager settings page for the service is also configured to port 80.";
    t[10039] = "Vaihtoehtoisen web-palvelimen m\u00e4\u00e4ritt\u00e4miseksi I2P:ll\u00e4 voit joko k\u00e4ytt\u00e4\u00e4 olemassa olevaa web-palvelinyhteytt\u00e4 ja <a href=/configclients>poistaa k\u00e4yt\u00f6st\u00e4 oletus-web-palvelimen</a> tai luoda uuden HTTP-palvelinyhteyden <a href=/i2ptunnelmgr>Tunnel Managerissa</a>. Varmista, ett\u00e4 web-palvelimen <i>kuunteluportti</i> on my\u00f6s m\u00e4\u00e4ritetty Tunnel Managerin asetuksiin. Esimerkiksi, jos web-palvelimesi kuuntelee oletusarvoisesti osoitteessa 127.0.0.1 portissa 80, sinun tulee my\u00f6s varmistaa, ett\u00e4 palvelulle tarkoitettu <i>kohdeportti</i> on m\u00e4\u00e4ritetty Tunnel Managerin asetussivulle porttiin 80.";
