    t[10046] = "An I2P router usually only needs to be seeded once, to join the network for the first time. However, if the router is running for an extended period without network connectivity it may also need to be reseeded. Reseeding involves fetching multiple \"RouterInfo\" files (bundled into a signed zip-file) from at least two predefined server URLs picked from a volunteer-run group of clearnet HTTPS servers.";
    t[10047] = "I2P-reititin tarvitsee yleens\u00e4 vain reseedin liitty\u00e4kseen verkkoon ensimm\u00e4isen kerran. Jos reititin py\u00f6rii pitk\u00e4\u00e4n ilman verkkoyhteytt\u00e4, voi olla tarpeen my\u00f6s reseedaaminen. Reseedaus tarkoittaa, ett\u00e4 useita \"RouterInfo\"-tiedostoja (pakattuna allekirjoitettuun zip-tiedostoon) haetaan v\u00e4hint\u00e4\u00e4n kahdesta ennaltam\u00e4\u00e4ritellyst\u00e4 palvelin-URLista, jotka on valittu vapaaehtoistoimintaan osallistuvasta joukosta \"clearnet\"-HTTPS-palvelimia.";
