    t[10076] = "A list of countries derived from the <a href=https://freedomhouse.org/report/countries-world-freedom-2019 class='sitelink external' target=_blank rel=noreferrer>World Freedom Report</a> with a poor civil liberties reputation. This list is used to place routers running in the specified countries in <i>Hidden Mode</i> to provide enhanced security for users. The following countries are designated as strict: Afghanistan, Azerbaijan, Bahrain, Belarus, Brunei, Burundi, Cameroon, Central African Republic, Chad, China, Cuba, Democratic Republic of the Congo, Egypt, Equatorial Guinea, Eritrea, Ethiopia, Iran, Kazakhstan, Laos, Libya, Myanmar, North Korea, Palestinian Territories, Rwanda, Saudi Arabia, Somalia, South Sudan, Sudan, Eswatini (Swaziland), Syria, Tajikistan, Thailand, Turkey, Turkmenistan, Venezuela, United Arab Emirates, Uzbekistan, Western Sahara, Yemen.";
    t[10077] = "Luettelo maista, jotka ovat per\u00e4isin <a href=https://freedomhouse.org/report/countries-world-freedom-2019 class='sitelink external' target=_blank rel=noreferrer>World Freedom Report</a>:sta ja joilla on huono maine kansalaisten vapauksien suhteen. T\u00e4t\u00e4 luetteloa k\u00e4ytet\u00e4\u00e4n sijoittamaan kyseisiin maihin sijoitetut reitittimet <i>Piilotustilaan</i> tarjotaksemme k\u00e4ytt\u00e4jille parannettua turvallisuutta. Seuraavat maat on m\u00e4\u00e4ritelty tiukoiksi: Afganistan, Azerbaid\u017ean, Bahrain, Valko-Ven\u00e4j\u00e4, Brunei, Burundi, Kamerun, Keski-Afrikan tasavalta, T\u0161ad, Kiina, Kuuba, Kongon demokraattinen tasavalta, Egypti, P\u00e4iv\u00e4ntasaajan Guinea, Eritrea, Etiopia, Iran, Kazakstan, Laos, Libya, Myanmar, Pohjois-Korea, Palestiinan territoriot, Ruanda, Saudi-Arabia, Somalia, Etel\u00e4-Sudan, Sudan, Eswatini (Swazimaa), Syyria, Tad\u017eikistan, Thaimaa, Turkki, Turkmenistan, Venezuela, Yhdistyneet arabiemiirikunnat, Uzbekistan, L\u00e4nsi-Sahara, Jemen.";
