    t[10294] = "A limited selection of stats is enabled by default, required for monitoring router performance. Only stats that have an optional graph are listed here; for a full list of enabled stats, view the <a href=\"/stats\">stats page</a>.";
    t[10295] = "Oletuksena on k\u00e4yt\u00f6ss\u00e4 rajoitettu valikoima tilastoja, jotka ovat tarpeen reitittimen suorituskyvyn seurantaan. T\u00e4\u00e4ll\u00e4 on lueteltu vain tilastot, joilla on valinnainen kaavio. Koko luettelo k\u00e4ytetyist\u00e4 tilastoista n\u00e4et <a href=\"/stats\">tilastosivulta</a>.";
