    t[10312] = "Please wait for routing commitment to expire for {0} tunnel";
    t[10313] = new java.lang.String[] { "Odota, ett\u00e4 reititysvelvoite vanhenee {0} tunnelille", "Odota, ett\u00e4 reititysvelvoitteet vanhenevat {0} tunnelille" };
    t[10318] = "Where possible, please ensure I2P+/Java is allowed bi-directional port access from the internet by configuring your modem/router/pc firewall accordingly. If you're behind a prohibitive firewall but have unrestricted outbound access, I2P+ can still function; you can turn off inbound access and rely on <a href=http://i2p-projekt.i2p/udp.html target=_blank rel=noreferrer class=sitelink>SSU IP Address Detection</a> (<a href=https://wikipedia.org/wiki/Hole_punching target=_blank rel=noreferrer class='sitelink external'>firewall hole punching</a>) to connect you to the network, and your network status in the side panel will indicate \"Status: Firewalled\". For optimal performance, please ensure I2P's <a href=/confignet#udpconfig>external port</a> is visible from the internet (see below for more information).";
    t[10319] = "Mik\u00e4li mahdollista, varmista, ett\u00e4 I2P+/Java:lla on kaksisuuntainen porttip\u00e4\u00e4sy internetist\u00e4 m\u00e4\u00e4ritt\u00e4m\u00e4ll\u00e4 modeemi/reititin/tietokoneen palomuuri sen mukaisesti. Mik\u00e4li k\u00e4yt\u00f6ss\u00e4si on rajoittava palomuuri, mutta sinulla on rajoittamaton ulosp\u00e4\u00e4sy, I2P+ voi toimia edelleen; voit kytke\u00e4 inbound-p\u00e4\u00e4syn pois p\u00e4\u00e4lt\u00e4 ja luottaa <a href=http://i2p-projekt.i2p/udp.html target=_blank rel=noreferrer class=sitelink>SSU IP -osoitteen tunnistamiseen</a> (<a href=https://wikipedia.org/wiki/Hole_punching target=_blank rel=noreferrer class='sitelink external'>palomuurin rei\u00e4n l\u00e4pily\u00f6nti</a>) verkon yhdist\u00e4miseksi, ja sivupaneelissa verkostotilasi ilmoittaa \"Status: Firewalled\". Optimaalisen suorituskyvyn saavuttamiseksi, varmista, ett\u00e4 I2P:n <a href=/confignet#udpconfig>ulkoiset portit</a> ovat n\u00e4kyvill\u00e4 internetiss\u00e4 (katso alla olevat tiedot).";
