    t[11107] = "T\u00e4m\u00e4 asetus (tunteina) mahdollistaa reitin tiedon i\u00e4n manuaalisen m\u00e4\u00e4rityksen, jotta se tarkistetaan P\u00e4ivitetyt Reitittimet -teht\u00e4v\u00e4n toimesta. Oletuksena reitin tiedon ik\u00e4 ennen p\u00e4ivityst\u00e4 mukautuu NetDb-kannan koon mukaan, kasvaen mit\u00e4 enemm\u00e4n NetDb-kanta kasvaa. Arvo 0 pakottaa P\u00e4ivitetyt Reitittimet -teht\u00e4v\u00e4n tarkistamaan jokaisen reitittimen NetDb-kannassa, riippumatta i\u00e4st\u00e4.";
