    t[11150] = "A tunnel to the main IRC server network within I2P, Irc2P, is created when I2P is installed (see the <a href=/i2ptunnelmgr>Tunnel Manager</a>), and is automatically started when the I2P router starts. To connect to it, tell your IRC client to connect to server: <code>127.0.0.1</code> port: <code>6668</code>.";
    t[11151] = "I2P:n asennuksen yhteydess\u00e4 luodaan tunneli I2P:n p\u00e4\u00e4-IRC-palvelinverkkoon, Irc2P, (katso <a href=/i2ptunnelmgr>tunnelin hallinta</a>), ja se k\u00e4ynnistyy automaattisesti, kun I2P-reititin k\u00e4ynnistyy. Voit yhdist\u00e4\u00e4 siihen kertomalla IRC-asiakasohjelman yhdist\u00e4\u00e4 palvelimeen: <code>127.0.0.1</code>, portti: <code>6668</code>.";
