    t[11516] = "In order to use a single set of tunnels for multiple client services, clients can be configured from the <i>Tunnel Manager</i> to operate in <i>Shared Client</i> mode. This mode conserves resources and blends the traffic from multiple clients into a single set of tunnels, making traffic analysis harder. Clients configured as Shared Clients share the same tunnel options.";
    t[11517] = "Voidakseen k\u00e4ytt\u00e4\u00e4 yht\u00e4 joukkoa tunneleita useille asiakaspalveluille asiakkaita voidaan konfiguroida <i>Tunnel Managerin</i> kautta toimimaan <i>Jaetun asiakkaan</i> tilassa. T\u00e4m\u00e4 tila s\u00e4\u00e4st\u00e4\u00e4 resursseja ja sekoittaa liikenteen useista asiakkaista yhteen sarjaan tunneleita, mik\u00e4 tekee liikenteen analysoinnista vaikeampaa. Jaetun asiakkaan tilassa konfiguroidut asiakkaat jakavat samat tunnelivaihtoehdot.";
