    t[11657] = "Viimeaikaiset koodimuutokset I2P+:ssa";
    t[11658] = "Your modem or router may support <a href=https://wikipedia.org/wiki/Universal_Plug_and_Play target=_blank rel=noreferrer>Universal Plug &amp; Play</a> (UPnP), which permits automatic port forwarding. Ensure UPnP support for I2P+ is enabled on the <a href=/confignet>config page</a>, then try to activate UPnP on your modem/router and possibly your computer also. Now try restarting the <a href=/>I2P+ router</a>. If successful, I2P+ should report \"Status: OK\" in the side panel once the I2P+ router completes initial connectivity tests.";
    t[11659] = "Modeemisi tai reitittimesi saattaa tukea <a href=https://wikipedia.org/wiki/Universal_Plug_and_Play target=_blank rel=noreferrer>Universal Plug &amp; Play</a> (UPnP) -toimintoa, joka mahdollistaa automaattisen portinohjauksen. Varmista, ett\u00e4 UPnP-tuki on k\u00e4yt\u00f6ss\u00e4 I2P+:lla <a href=/confignet>asetussivulla</a>, ja yrit\u00e4 sitten aktivoida UPnP modeemissa/reitittimess\u00e4si sek\u00e4 mahdollisesti tietokoneessa. Kokeile k\u00e4ynnist\u00e4\u00e4 nyt <a href=/>I2P+ reititin</a>. Jos onnistut, I2P+ ilmoittaa \"Tila: OK\" -esityksen sivupaneelissa, kun I2P+:n reititin on suorittanut ensisijaiset yhteyskokeet.";
