    t[11982] = "If your TCP port is firewalled with inbound TCP enabled, routers will not be able to contact you via TCP, which will hurt the network.";
    t[11983] = "Jos TCP -porttisi on palomuurin takana ja sis\u00e4\u00e4ntuleva TCP -liikenne sallittu, muut reitittimet eiv\u00e4t voi ottaa sinuun yhteytt\u00e4 TCP:n kautta, mik\u00e4 vahingoittaa verkkoa.";
    t[11984] = "Local Identity";
    t[11985] = "Paikallinen Identiteetti";
    t[11994] = "While I2P will work fine behind most firewalls, your speeds and network integration will generally improve if the I2P port is forwarded for both UDP and TCP.";
    t[11995] = "Vaikka I2P toimii hyvin useimpien palomuurien takana, nopeudesi ja verkkointegraatiosi paranevat yleens\u00e4, jos I2P-portti v\u00e4litet\u00e4\u00e4n sek\u00e4 UDP:lle ett\u00e4 TCP:lle.";
