    t[12020] = "Tunnels longer than 3 hops (for example 2 hops + 0-2 hops, 3 hops + 0-1 hops, 3 hops + 0-2 hops), or a high quantity + backup quantity, may severely reduce performance or reliability.";
    t[12021] = "K\u00e4yt\u00e4v\u00e4t, jotka ovat pidempi\u00e4 kuin 3 hyppy\u00e4  (esim. 2 hyppy\u00e4 + 0-2 hyppy\u00e4, 3 hyppy\u00e4 + 0-1 hyppy\u00e4, 3 hyppy\u00e4 + 0-2 hyppy\u00e4) tai suuri m\u00e4\u00e4r\u00e4 + suuri m\u00e4\u00e4r\u00e4 varalla, voivat heikent\u00e4\u00e4 tehokkuutta tai luotettavuutta pahasti.";
    t[12022] = "Sidebar";
    t[12023] = "Sivupalkki";
    t[12024] = "A router that facilitates the connection to the network of another router that is behind a firewall.";
    t[12025] = "Reititin, joka helpottaa toisen reitittimen, joka on palomuurin takana, yhteyden muodostamista verkkoon.";
    t[12026] = "I2P FAQ";
    t[12027] = "I2P UKK";
    t[12028] = "If you hover over the <i>Router Info</i> heading, your truncated router identity will be shown (the first four characters (24 bits) of your 44-character (256-bit) Base64 router hash). The full hash is shown on your <a href='netdb?r=.'>Network Database entry</a>. Never reveal this to anyone, as your router identity is uniquely linked to your IP address in the network database.";
    t[12029] = "Jos pid\u00e4t hiiren osoittimen <i>Reititin tiedot</i> -otsikon p\u00e4\u00e4ll\u00e4, leikattu reititin tunnisteesi n\u00e4ytet\u00e4\u00e4n (T\u00e4m\u00e4 tarkoittaa 24 bitti\u00e4 eli 4 ensimm\u00e4ist\u00e4 merkki\u00e4 44 merkin (256 bitti\u00e4) pituisesta base64-reititinviiteest\u00e4si). Koko viite n\u00e4ytet\u00e4\u00e4n <a href='netdb?r=.'>Virtuaalisessa reititintietokannassa</a>. \u00c4l\u00e4 ikin\u00e4 paljasta t\u00e4t\u00e4 kenellek\u00e4\u00e4n. reititin identiteettisi on yksil\u00f6iv\u00e4sti linkitetty IP-osoitteeseesi reititintietokannassa.";
    t[12030] = "Previous";
    t[12031] = "Edellinen";
    t[12032] = "Stopped router";
    t[12033] = "Pys\u00e4ytetty reititin";
    t[12038] = "Directory listings (sometimes referred to as virtual directories) are enabled by default, so you can host files from a sub-directory of <code>docroot</code> without providing a page with links to the files. You can also serve content that exists outside of <code>docroot</code> by using a <a href=https://en.wikipedia.org/wiki/Symbolic_link target=_blank rel=noreferrer class='sitelink external'>symbolic link</a> to the desired directory.";
    t[12039] = "Hakemistoluettelo (joskus kutsuttu virtuaalisiksi hakemistoiksi) on oletuksena k\u00e4yt\u00f6ss\u00e4, jolloin voit is\u00e4nn\u00f6id\u00e4 tiedostoja <code>docroot</code>:n alahakemistosta ilman, ett\u00e4 tarvitset sivua, jossa on linkkej\u00e4 tiedostoihin. Voit my\u00f6s palvella sis\u00e4lt\u00f6\u00e4, joka sijaitsee <code>docroot</code>:n ulkopuolella k\u00e4ytt\u00e4m\u00e4ll\u00e4 halutulle hakemistolle <a href=https://en.wikipedia.org/wiki/Symbolic_link target=_blank rel=noreferrer class='sitelink external'>symbolista linkki\u00e4</a>.";
    t[12044] = "You have configured I2P to share only {0} KBps.";
