    t[12117] = "Ei h\u00e4t\u00e4\u00e4, mutta yl\u00e4puolella olevat reitittimet ovat keskim\u00e4\u00e4r\u00e4ist\u00e4 v\u00e4himm\u00e4iset\u00e4isyytt\u00e4 l\u00e4hemp\u00e4n\u00e4";
