    t[12152] = "Note: Many of the labels and options in the console have tooltips that indicate purpose or explain the meaning. Hover over the label or option to activate the tooltip.";
    t[12153] = "Huomautus: Monilla labeleilla ja vaihtoehdoilla hallintapaneelissa on ty\u00f6kaluvihjeit\u00e4, jotka osoittavat tarkoituksen tai selitt\u00e4v\u00e4t merkityksen. Vie hiiri opastuksen p\u00e4\u00e4lle aktivoidaksesi sen.";
