    t[12175] = "Ei UPnP-yhteensopivaa laitetta";
    t[12182] = "Reason";
    t[12183] = "Syy";
    t[12184] = "This setting determines the number of NetDb DHT buckets the Peer Exploration Job will reference when run. By default, the number of buckets to explore will vary depending on whether the router has been running for over an hour, if the router is hidden or in the 'K' bandwidth tier, and the number of known routers.";
    t[12185] = "T\u00e4m\u00e4 asetus m\u00e4\u00e4ritt\u00e4\u00e4 kuinka monta NetDb DHT -\u00e4mp\u00e4ri\u00e4 Verkoston tutkinta-ty\u00f6 tekee. Oletusarvoisesti tutkittavien \u00e4mp\u00e4rien m\u00e4\u00e4r\u00e4 vaihtelee riippuen siit\u00e4, onko reititin ollut k\u00e4ynniss\u00e4 yli tunnin, onko reititin piilotettu tai kuuluuko se tehostetun kaistanleveyden laatualueeseen ja kuinka monta vertaista on tiedossa.";
    t[12186] = "threat points";
    t[12187] = "uhkapisteet";
    t[12194] = "Failed to stop systray";
    t[12195] = "Systrayn pys\u00e4ytt\u00e4minen ep\u00e4onnistui";
    t[12196] = "Update failed";
    t[12197] = "P\u00e4ivitys ep\u00e4onnistui";
    t[12198] = "Hostname Registration";
    t[12199] = "Is\u00e4nt\u00e4nimen rekister\u00f6inti";
    t[12200] = "If the number of known peers drops below 50, I2P will attempt to reseed automatically. If the reseed attempt fails, a notification will appear in the sidebar with an option to manually reseed. A failed reseed attempt can occur if your local firewall limits outbound traffic, you are experiencing network connectivity issues, or if the reseed request is blocked entirely.";
    t[12201] = "Jos tunnettujen yhteyksien m\u00e4\u00e4r\u00e4 putoaa alle 50:n, I2P yritt\u00e4\u00e4 reseedaamista automaattisesti. Jos reseed-yritys ep\u00e4onnistuu, tulee sivupalkeeseen ilmoitus, jossa on vaihtoehto reseedaamiseen manuaalisesti. Reseed-yritys voi ep\u00e4onnistua, jos paikallinen palomuuri rajoittaa ulosmenev\u00e4\u00e4 liikennett\u00e4, sinulla on ongelmia verkkoyhteydess\u00e4 tai jos reseed-pyynt\u00f6 on estetty kokonaan.";
    t[12202] = "Alternative privacy-focused front-end for Reddit";
    t[12203] = "Vaihtoehtoinen yksityisyyteen keskittyv\u00e4 k\u00e4ytt\u00f6liittym\u00e4 Redditille";
    t[12224] = "Toggle Tunnels";
    t[12225] = "K\u00e4yt\u00e4/loptaa tuneleja";
    t[12228] = "Can be disabled in the <code>clients.config</code> file. Can also be configured to bind to a specific interface or all interfaces in the <code>jetty.xml</code> file.";
    t[12229] = "Voidaan poistaa k\u00e4yt\u00f6st\u00e4 <code>clients.config</code>-tiedostossa. Voidaan my\u00f6s m\u00e4\u00e4ritt\u00e4\u00e4 sitoutumaan tiettyyn rajapintaan tai kaikkiin rajapintoihin <code>jetty.xml</code>-tiedostossa.";
    t[12230] = "You can determine which services automatically start when the router starts, manage tunnel allocation to optimize for high usage services or to minimize the the cpu and memory overhead, add server and client tunnels to host or access services on the network, set rate limiting or tunnel filtering for your server tunnels and more.";
    t[12231] = "Voit m\u00e4\u00e4ritt\u00e4\u00e4, mitk\u00e4 palvelut k\u00e4ynnistyv\u00e4t automaattisesti, kun reititin k\u00e4ynnistyy, hallita tunnelien jakoa korkeak\u00e4ytt\u00f6isille palveluille tai minimoida CPU- ja muistikuorman, lis\u00e4t\u00e4 palvelin- ja asiakastunneleita verkossa olevien palveluiden is\u00e4nn\u00f6imiseen tai niihin p\u00e4\u00e4st\u00e4kseen, m\u00e4\u00e4ritt\u00e4\u00e4 nopeudenrajoituksia tai tunneloiden suodattamista palvelintunneleille jne.";
    t[12232] = "Binds to the LAN address. Can be changed with advanced config <code>i2np.upnp.HTTPPort=nnnn</code>. Can be disabled on the <a href=/confignet>Network Configuration page</a>.";
